JacobiSD::usage = "\!\(\*RowBox[{\"JacobiSD\", \"[\", RowBox[{StyleBox[\"u\", \"TI\"], \",\", StyleBox[\"m\", \"TI\"]}], \"]\"}]\) gives the Jacobi elliptic function \!\(\*RowBox[{\"sd\", \"(\", RowBox[{\"u\", \"|\", \"m\"}], \")\"}]\)."
