NBodySimulation::usage = "\!\(\*RowBox[{\"NBodySimulation\", \"[\", RowBox[{StyleBox[\"law\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"state\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"], \",\", SubscriptBox[StyleBox[\"state\", \"TI\"], StyleBox[\"n\", \"TI\"]]}], \"}\"}], \",\", StyleBox[\"t\", \"TI\"]}], \"]\"}]\) generates a simulation of the motion of a system of \!\(\*StyleBox[\"n\", \"TI\"]\) bodies with initial states \!\(\*SubscriptBox[StyleBox[\"state\", \"TI\"], StyleBox[\"i\", \"TI\"]]\), governed by the specified potential or force law, over a length of time \!\(\*StyleBox[\"t\", \"TI\"]\).\n\!\(\*RowBox[{\"NBodySimulation\", \"[\", RowBox[{StyleBox[\"law\", \"TI\"], \",\", RowBox[{\"<|\", RowBox[{RowBox[{SubscriptBox[StyleBox[\"body\", \"TI\"], StyleBox[\"1\", \"TR\"]], \"\[Rule]\", SubscriptBox[StyleBox[\"state\", \"TI\"], StyleBox[\"1\", \"TR\"]]}], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"], \",\", RowBox[{SubscriptBox[StyleBox[\"body\", \"TI\"], StyleBox[\"n\", \"TI\"]], \"\[Rule]\", SubscriptBox[StyleBox[\"state\", \"TI\"], StyleBox[\"n\", \"TI\"]]}]}], \"|>\"}], \",\", StyleBox[\"t\", \"TI\"]}], \"]\"}]\) generates a simulation of the motion of a system of \!\(\*StyleBox[\"n\", \"TI\"]\) bodies with names \!\(\*SubscriptBox[StyleBox[\"body\", \"TI\"], StyleBox[\"i\", \"TI\"]]\)."
