x[{\"{\", RowBox[{StyleBox[\"x\", \"TI\"], \",\", StyleBox[\"y\", \"TI\"], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}], \"\[Element]\", StyleBox[\"\[CapitalOmega]\", \"TR\"]}], \",\", StyleBox[\"n\", \"TI\"]}], \"]\"}], \" \"}]\) gives eigenvalues and eigenfunctions for the coupled differential operators \!\(\*RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"op\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"op\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}]\) over the region \!\(\*StyleBox[\"\[CapitalOmega]\", \"TR\"]\).\n\!\(\*RowBox[{\"NDEigensystem\", \"[\", RowBox[{StyleBox[\"eqns\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{StyleBox[\"u\", \"TI\"], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}], \",\", StyleBox[\"t\", \"TI\"], \",\", RowBox[{RowBox[{\"{\", RowBox[{StyleBox[\"x\", \"TI\"], \",\", StyleBox[\"y\", \"TI\"], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}], \"\[Element]\", StyleBox[\"\[CapitalOmega]\", \"TR\"]}], \",\", StyleBox[\"n\", \"TI\"]}], \"]\"}]\) gives the eigenvalues and eigenfunctions in the spatial variables \!\(\*RowBox[{\"{\", RowBox[{StyleBox[\"x\", \"TI\"], \",\", StyleBox[\"y\", \"TI\"], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}]\) for solutions \!\(\*RowBox[{StyleBox[\"u\", \"TI\"], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}]\) of the coupled time-dependent differential equations \!\(\*StyleBox[\"eqns\", \"TI\"]\)."
