NearestFunction::usage = "\!\(\*RowBox[{\"NearestFunction\", \"[\", StyleBox[\"data\", \"TI\"], \"]\"}]\) represents a function whose values give the elements closest to an element that is supplied."
NearestMeshCells::usage = "\!\(\*RowBox[{\"NearestMeshCells\", \"[\", RowBox[{StyleBox[\"mr\", \"TI\"], \",\", StyleBox[\"pt\", \"TI\"]}], \"]\"}]\) gives the indices for the cells to which the point \!\(\*StyleBox[\"pt\", \"TI\"]\) is nearest in the mesh region \!\(\*StyleBox[\"mr\", \"TI\"]\).\n\!\(\*RowBox[{\"NearestMeshCells\", \"[\", RowBox[{StyleBox[\"mr\", \"TI\"], \",\", StyleBox[\"pt\", \"TI\"], \",\", StyleBox[\"n\", \"TI\"]}], \"]\"}]\) gives the \!\(\*StyleBox[\"n\", \"TI\"]\) nearest cell indices to \!\(\*StyleBox[\"pt\", \"TI\"]\).\n\!\(\*RowBox[{\"NearestMeshCells\", \"[\", RowBox[{StyleBox[\"mr\", \"TI\"], \",\", StyleBox[\"pt\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{StyleBox[\"n\", \"TI\"], \",\", StyleBox[\"r\", \"TI\"]}], \"}\"}]}], \"]\"}]\) gives the \!\(\*StyleBox[\"n\", \"TI\"]\) or fewer nearest cell indices to \!\(\*StyleBox[\"pt\", \"TI\"]\) that are within radius \!\(\*StyleBox[\"r\", \"TI\"]\) of \!\(\*StyleBox[\"pt\", \"TI\"]\).\n\!\(\*RowBox[{\"NearestMeshCells\", \"[\", RowBox[{RowBox[{\"{\", RowBox[{StyleBox[\"mr\", \"TI\"], \",\", StyleBox[\"d\", \"TI\"]}], \"}\"}], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"]\"}]\) gives the indices for the cells of dimension \!\(\*StyleBox[\"d\", \"TI\"]\)."
NearestNeighborGraph::usage = "\!\(\*RowBox[{\"NearestNeighborGraph\", \"[\", RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}], \"]\"}]\) gives a graph with vertices \!\(\*RowBox[{SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}]\) and edges connecting each \!\(\*SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"i\", \"TI\"]]\) to its nearest neighbors.\n\!\(\*RowBox[{\"NearestNeighborGraph\", \"[\", RowBox[{RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}], \",\", StyleBox[\"k\", \"TI\"]}], \"]\"}]\) gives a graph connecting each \!\(\*SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"i\", \"TI\"]]\) to its \!\(\*StyleBox[\"k\", \"TI\"]\) nearest neighbors.\n\!\(\*RowBox[{\"NearestNeighborGraph\", \"[\", RowBox[{RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}], \",\", RowBox[{\"{\", RowBox[{StyleBox[\"k\", \"TI\"], \",\", StyleBox[\"r\", \"TI\"]}], \"}\"}]}], \"]\"}]\) gives a graph connecting each \!\(\*SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"i\", \"TI\"]]\) to at most \!\(\*StyleBox[\"k\", \"TI\"]\) nearest vertices within radius \!\(\*StyleBox[\"r\", \"TI\"]\) of \!\(\*SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"i\", \"TI\"]]\).\n\!\(\*RowBox[{\"NearestNeighborGraph\", \"[\", RowBox[{RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}], \",\", RowBox[{\"{\", RowBox[{\"All\", \",\", StyleBox[\"r\", \"TI\"]}], \"}\"}]}], \"]\"}]\) gives a graph connecting each \!\(\*SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"i\", \"TI\"]]\) to all vertices within radius \!\(\*StyleBox[\"r\", \"TI\"]\) of \!\(\*SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"i\", \"TI\"]]\)."
NearestTo::usage = "\!\(\*RowBox[{\"NearestTo\", \"[\", StyleBox[\"x\", \"TI\"], \"]\"}]\) is an operator form that yields \!\(\*RowBox[{\"Nearest\", \"[\", RowBox[{StyleBox[\"elems\", \"TI\"], \",\", StyleBox[\"x\", \"TI\"]}], \"]\"}]\) when applied to a list \!\(\*StyleBox[\"elems\", \"TI\"]\).\n\!\(\*RowBox[{\"NearestTo\", \"[\", RowBox[{StyleBox[\"x\", \"TI\"], \",\", StyleBox[\"n\", \"TI\"]}], \"]\"}]\) is an operator form that yields \!\(\*RowBox[{\"Nearest\", \"[\", RowBox[{StyleBox[\"elems\", \"TI\"], \",\", StyleBox[\"x\", \"TI\"], StyleBox[\",\", \"TI\"], StyleBox[\"n\", \"TI\"]}], \"]\"}]\) when applied to a list \!\(\*StyleBox[\"elems\", \"TI\"]\).\n\!\(\*RowBox[{\"NearestTo\", \"[\", RowBox[{StyleBox[\"x\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{StyleBox[\"n\", \"TI\"], \",\", StyleBox[\"r\", \"TI\"]}], \"}\"}]}], \"]\"}]\) is an operator form that yields \!\(\*RowBox[{\"Nearest\", \"[\", RowBox[{StyleBox[\"elems\", \"TI\"], \",\", StyleBox[\"x\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{StyleBox[\"n\", \"TI\"], \",\", StyleBox[\"r\", \"TI\"]}], \"}\"}]}], \"]\"}]\) when applied to a list \!\(\*StyleBox[\"elems\", \"TI\"]\)."
Nearest::usage = "\!\(\*RowBox[{\"Nearest\", \"[\", RowBox[{RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}], \",\", StyleBox[\"x\", \"TI\"]}], \"]\"}]\) gives the list of \!\(\*SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"i\", \"TI\"]]\) to which \!\(\*StyleBox[\"x\", \"TI\"]\) is nearest. \n\!\(\*RowBox[{\"Nearest\", \"[\", RowBox[{RowBox[{\"{\", RowBox[{RowBox[{SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"1\", \"TR\"]], \"\[Rule]\", SubscriptBox[StyleBox[\"v\", \"TI\"], StyleBox[\"1\", \"TR\"]]}], \",\", RowBox[{SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"2\", \"TR\"]], \"\[Rule]\", SubscriptBox[StyleBox[\"v\", \"TI\"], StyleBox[\"2\", \"TR\"]]}], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}], \",\", StyleBox[\"x\", \"TI\"]}], \"]\"}]\) gives the \!\(\*SubscriptBox[StyleBox[\"v\", \"TI\"], StyleBox[\"i\", \"TI\"]]\) corresponding to the \!\(\*SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"i\", \"TI\"]]\) to which \!\(\*StyleBox[\"x\", \"TI\"]\) is nearest. \n\!\(\*RowBox[{\"Nearest\", \"[\", RowBox[{RowBox[{RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}], \"\[Rule]\", RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"v\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"v\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}]}], \",\", StyleBox[\"x\", \"TI\"]}], \"]\"}]\) gives the same result. \n\!\(\*RowBox[{\"Nearest\", \"[\", RowBox[{RowBox[{RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}], \"\[Rule]\", StyleBox[\"prop\", \"TI\"]}], \",\", StyleBox[\"x\", \"TI\"]}], \"]\"}]\) gives the property \!\(\*StyleBox[\"prop\", \"TI\"]\) for the \!\(\*SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"i\", \"TI\"]]\) to which \!\(\*StyleBox[\"x\", \"TI\"]\) is nearest.\n\!\(\*RowBox[{\"Nearest\", \"[\", RowBox[{StyleBox[\"data\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"x\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"x\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}]}], \"]\"}]\) effectively gives \!\(\*RowBox[{\"{\", RowBox[{RowBox[{\"Nearest\", \"[\", RowBox[{StyleBox[\"data\", \"TI\"], \",\", SubscriptBox[StyleBox[\"x\", \"TI\"], StyleBox[\"1\", \"TR\"]]}], \"]\"}], \",\", RowBox[{\"Nearest\", \"[\", RowBox[{StyleBox[\"data\", \"TI\"], \",\", SubscriptBox[StyleBox[\"x\", \"TI\"], StyleBox[\"2\", \"TR\"]]}], \"]\"}], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}]\).\n\!\(\*RowBox[{\"Nearest\", \"[\", RowBox[{StyleBox[\"data\", \"TI\"], \",\", StyleBox[\"x\", \"TI\"], \",\", StyleBox[\"n\", \"TI\"]}], \"]\"}]\) gives the \!\(\*StyleBox[\"n\", \"TI\"]\) nearest \!\(\*SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"i\", \"TI\"]]\) to \!\(\*StyleBox[\"x\", \"TI\"]\). \n\!\(\*RowBox[{\"Nearest\", \"[\", RowBox[{StyleBox[\"data\", \"TI\"], \",\", StyleBox[\"x\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{StyleBox[\"n\", \"TI\"], \",\", StyleBox[\"r\", \"TI\"]}], \"}\"}]}], \"]\"}]\) gives the \!\(\*StyleBox[\"n\", \"TI\"]\) or fewer nearest \!\(\*SubscriptBox[StyleBox[\"elem\", \"TI\"], StyleBox[\"i\", \"TI\"]]\) to \!\(\*StyleBox[\"x\", \"TI\"]\) that are within radius \!\(\*StyleBox[\"r\", \"TI\"]\) of \!\(\*StyleBox[\"x\", \"TI\"]\).\n\!\(\*RowBox[{\"Nearest\", \"[\", StyleBox[\"data\", \"TI\"], \"]\"}]\) generates a \!\(\*RowBox[{\"NearestFunction\", \"[\", StyleBox[\"\[Ellipsis]\", \"TR\"], \"]\"}]\) that can be applied repeatedly to different \!\(\*StyleBox[\"x\", \"TI\"]\). "
NebulaData::usage = "\!\(\*RowBox[{\"NebulaData\", \"[\", RowBox[{StyleBox[\"entity\", \"TI\"], \",\", StyleBox[\"property\", \"TI\"]}], \"]\"}]\) gives the value of the specified \!\(\*StyleBox[\"property\", \"TI\"]\) for the nebula \!\(\*StyleBox[\"entity\", \"TI\"]\).\n\!\(\*RowBox[{\"NebulaData\", \"[\", RowBox[{RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"entity\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"entity\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}], \",\", StyleBox[\"property\", \"TI\"]}], \"]\"}]\) gives a list of property values for the specified nebula entities.\n\!\(\*RowBox[{\"NebulaData\", \"[\", RowBox[{StyleBox[\"entity\", \"TI\"], \",\", StyleBox[\"property\", \"TI\"], \",\", StyleBox[\"annotation\", \"TI\"]}], \"]\"}]\) gives the specified \!\(\*StyleBox[\"annotation\", \"TI\"]\) associated with the given \!\(\*StyleBox[\"property\", \"TI\"]\)."
NeedlemanWunschSimilarity::usage = "\!\(\*RowBox[{\"NeedlemanWunschSimilarity\", \"[\", RowBox[{StyleBox[\"u\", \"TI\"], \",\", StyleBox[\"v\", \"TI\"]}], \"]\"}]\) gives a number representing the Needleman\[Dash]Wunsch similarity between strings or vectors \!\(\*StyleBox[\"u\", \"TI\"]\) and \!\(\*StyleBox[\"v\", \"TI\"]\)."
Needs::usage = "\!\(\*RowBox[{\"Needs\", \"[\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"context\\\",\\\"TI\\\"]\\)`\\\"\", ShowStringCharacters->True], \"]\"}]\) loads an appropriate file if the specified context is not already in $Packages. \n\!\(\*RowBox[{\"Needs\", \"[\", RowBox[{StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"context\\\",\\\"TI\\\"]\\)`\\\"\", ShowStringCharacters->True], \",\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"file\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True]}], \"]\"}]\) loads \!\(\*StyleBox[\"file\", \"TI\"]\) if the specified context is not already in $Packages. "
NegativeBinomialDistribution::usage = "\!\(\*RowBox[{\"NegativeBinomialDistribution\", \"[\", RowBox[{StyleBox[\"n\", \"TI\"], \",\", StyleBox[\"p\", \"TI\"]}], \"]\"}]\) represents a negative binomial distribution with parameters \!\(\*StyleBox[\"n\", \"TI\"]\) and \!\(\*StyleBox[\"p\", \"TI\"]\)."
NegativeDefiniteMatrixQ::usage = "\!\(\*RowBox[{\"NegativeDefiniteMatrixQ\", \"[\", StyleBox[\"m\", \"TI\"], \"]\"}]\) gives True if \!\(\*StyleBox[\"m\", \"TI\"]\) is explicitly negative definite, and False otherwise."
NegativeIntegers::usage = "NegativeIntegers represents the domain of strictly negative integers, as in \!\(\*RowBox[{StyleBox[\"x\", \"TI\"], \"\[Element]\", \"NegativeIntegers\"}]\). "
NegativeMultinomialDistribution::usage = "\!\(\*RowBox[{\"NegativeMultinomialDistribution\", \"[\", RowBox[{StyleBox[\"n\", \"TI\"], \",\", StyleBox[\"p\", \"TI\"]}], \"]\"}]\) represents a negative multinomial distribution with parameter \!\(\*StyleBox[\"n\", \"TI\"]\) and failure probability vector \!\(\*StyleBox[\"p\", \"TI\"]\)."
NegativeRationals::usage = "NegativeRationals represents the domain of strictly negative rational numbers, as in \!\(\*RowBox[{StyleBox[\"x\", \"TI\"], StyleBox[\"\[Element]\", \"TR\"], \"NegativeRationals\"}]\). "
NegativeReals::usage = "NegativeReals represents the domain of strictly negative real numbers."
NegativeSemidefiniteMatrixQ::usage = "\!\(\*RowBox[{\"NegativeSemidefiniteMatrixQ\", \"[\", StyleBox[\"m\", \"TI\"], \"]\"}]\) gives True if \!\(\*StyleBox[\"m\", \"TI\"]\) is explicitly negative semidefinite, and False otherwise."
Negative::usage = "\!\(\*RowBox[{\"Negative\", \"[\", StyleBox[\"x\", \"TI\"], \"]\"}]\) gives True if \!\(\*StyleBox[\"x\", \"TI\"]\) is a negative number. "
NeighborhoodData::usage = "\!\(\*RowBox[{\"NeighborhoodData\", \"[\", RowBox[{StyleBox[\"entity\", \"TI\"], \",\", StyleBox[\"property\", \"TI\"]}], \"]\"}]\) gives the value of the specified \!\(\*StyleBox[\"property\", \"TI\"]\) for the neighborhood \!\(\*StyleBox[\"entity\", \"TI\"]\).\n\!\(\*RowBox[{\"NeighborhoodData\", \"[\", RowBox[{RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"entity\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"entity\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}], \",\", StyleBox[\"property\", \"TI\"]}], \"]\"}]\) gives a list of property values for the specified neighborhood entities.\n\!\(\*RowBox[{\"NeighborhoodData\", \"[\", RowBox[{StyleBox[\"entity\", \"TI\"], \",\", StyleBox[\"property\", \"TI\"], \",\", StyleBox[\"annotation\", \"TI\"]}], \"]\"}]\) gives the specified \!\(\*StyleBox[\"annotation\", \"TI\"]\) associated with the given \!\(\*StyleBox[\"property\", \"TI\"]\)."
NeighborhoodGraph::usage = "\!\(\*RowBox[{\"NeighborhoodGraph\", \"[\", RowBox[{StyleBox[\"g\", \"TI\"], \",\", StyleBox[\"v\", \"TI\"]}], \"]\"}]\) gives the graph neighborhood of a vertex \!\(\*StyleBox[\"v\", \"TI\"]\) in the graph \!\(\*StyleBox[\"g\", \"TI\"]\).\n\!\(\*RowBox[{\"NeighborhoodGraph\", \"[\", RowBox[{StyleBox[\"g\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"a\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"a\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}]}], \"]\"}]\) gives the graph neighborhood of the \!\(\*SubscriptBox[StyleBox[\"a\", \"TI\"], StyleBox[\"i\", \"TI\"]]\) that can be vertices, edges, or subgraphs of \!\(\*StyleBox[\"g\", \"TI\"]\).\n\!\(\*RowBox[{\"NeighborhoodGraph\", \"[\", RowBox[{StyleBox[\"g\", \"TI\"], \",\", StyleBox[\"patt\", \"TI\"]}], \"]\"}]\) gives the graph neighborhood of the vertices and edges that match the pattern \!\(\*StyleBox[\"patt\", \"TI\"]\).\n\!\(\*RowBox[{\"NeighborhoodGraph\", \"[\", RowBox[{StyleBox[\"g\", \"TI\"], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"], \",\", StyleBox[\"d\", \"TI\"]}], \"]\"}]\) gives the neighborhood up to distance \!\(\*StyleBox[\"d\", \"TI\"]\).\n\!\(\*RowBox[{\"NeighborhoodGraph\", \"[\", RowBox[{RowBox[{\"{\", RowBox[{RowBox[{StyleBox[\"v\", \"TI\"], \"\[Rule]\", StyleBox[\"w\", \"TI\"]}], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}], \",\", \"\[Ellipsis]\"}], \"]\"}]\) uses rules \!\(\*RowBox[{StyleBox[\"v\", \"TI\"], \"\[Rule]\", StyleBox[\"w\", \"TI\"]}]\) to specify the graph \!\(\*StyleBox[\"g\", \"TI\"]\)."
NestedGreaterGreater::usage = "\!\(\*RowBox[{\"NestedGreaterGreater\", \"[\", RowBox[{StyleBox[\"x\", \"TI\"], \",\", StyleBox[\"y\", \"TI\"], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"]\"}]\) displays as \!\(\*RowBox[{StyleBox[\"x\", \"TI\"], \"\[NestedGreaterGreater]\", StyleBox[\"y\", \"TI\"], \"\[NestedGreaterGreater]\", StyleBox[\"\[Ellipsis]\", \"TR\"]}]\)."
NestedLessLess::usage = "\!\(\*RowBox[{\"NestedLessLess\", \"[\", RowBox[{StyleBox[\"x\", \"TI\"], \",\", StyleBox[\"y\", \"TI\"], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"]\"}]\) displays as \!\(\*RowBox[{StyleBox[\"x\", \"TI\"], \"\[NestedLessLess]\", StyleBox[\"y\", \"TI\"], \"\[NestedLessLess]\", \"\[Ellipsis]\"}]\)."
NestGraph::usage = "\!\(\*RowBox[{\"NestGraph\", \"[\", RowBox[{StyleBox[\"f\", \"TI\"], \",\", StyleBox[\"expr\", \"TI\"], \",\", StyleBox[\"n\", \"TI\"]}], \"]\"}]\) gives the graph obtained by starting with \!\(\*StyleBox[\"expr\", \"TI\"]\) and applying \!\(\*StyleBox[\"f\", \"TI\"]\) successively \!\(\*StyleBox[\"n\", \"TI\"]\) times.\n\!\(\*RowBox[{\"NestGraph\", \"[\", RowBox[{StyleBox[\"f\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"expr\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"expr\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}], \",\", StyleBox[\"n\", \"TI\"]}], \"]\"}]\) gives the graph obtained by applying \!\(\*StyleBox[\"f\", \"TI\"]\) to \!\(\*SubscriptBox[StyleBox[\"expr\", \"TI\"], StyleBox[\"1\", \"TR\"]]\), \!\(\*SubscriptBox[StyleBox[\"expr\", \"TI\"], StyleBox[\"2\", \"TR\"]]\), \!\(\*StyleBox[\"\[Ellipsis]\", \"TR\"]\).\n\!\(\*RowBox[{\"NestGraph\", \"[\", RowBox[{StyleBox[\"f\", \"TI\"], \",\", StyleBox[\"graph\", \"TI\"], \",\", StyleBox[\"n\", \"TI\"]}], \"]\"}]\) gives the graph obtained by applying \!\(\*StyleBox[\"f\", \"TI\"]\) to the vertices of \!\(\*StyleBox[\"graph\", \"TI\"]\) and extending the \!\(\*StyleBox[\"graph\", \"TI\"]\)."
NestList::usage = "\!\(\*RowBox[{\"NestList\", \"[\", RowBox[{StyleBox[\"f\", \"TI\"], \",\", StyleBox[\"expr\", \"TI\"], \",\", StyleBox[\"n\", \"TI\"]}], \"]\"}]\) gives a list of the results of applying \!\(\*StyleBox[\"f\", \"TI\"]\) to \!\(\*StyleBox[\"expr\", \"TI\"]\) 0 through \!\(\*StyleBox[\"n\", \"TI\"]\) times. "
Nest::usage = "\!\(\*RowBox[{\"Nest\", \"[\", RowBox[{StyleBox[\"f\", \"TI\"], \",\", StyleBox[\"expr\", \"TI\"], \",\", StyleBox[\"n\", \"TI\"]}], \"]\"}]\) gives an expression with \!\(\*StyleBox[\"f\", \"TI\"]\) applied \!\(\*StyleBox[\"n\", \"TI\"]\) times to \!\(\*StyleBox[\"expr\", \"TI\"]\). "
NestWhileList::usage = "\!\(\*RowBox[{\"NestWhileList\", \"[\", RowBox[{StyleBox[\"f\", \"TI\"], \",\", StyleBox[\"expr\", \"TI\"], \",\", StyleBox[\"test\", \"TI\"]}], \"]\"}]\) generates a list of the results of applying \!\(\*StyleBox[\"f\", \"TI\"]\) repeatedly, starting with \!\(\*StyleBox[\"expr\", \"TI\"]\), and continuing until applying \!\(\*StyleBox[\"test\", \"TI\"]\) to the result no longer yields True. \n\!\(\*RowBox[{\"NestWhileList\", \"[\", RowBox[{StyleBox[\"f\", \"TI\"], \",\", StyleBox[\"expr\", \"TI\"], \",\", StyleBox[\"test\", \"TI\"], \",\", StyleBox[\"m\", \"TI\"]}], \"]\"}]\) supplies the most recent \!\(\*StyleBox[\"m\", \"TI\"]\) results as arguments for \!\(\*StyleBox[\"test\", \"TI\"]\) at each step. \n\!\(\*RowBox[{\"NestWhileList\", \"[\", RowBox[{StyleBox[\"f\", \"TI\"], \",\", StyleBox[\"expr\", \"TI\"], \",\", StyleBox[\"test\", \"TI\"], \",\", \"All\"}], \"]\"}]\) supplies all results so far as arguments for \!\(\*StyleBox[\"test\", \"TI\"]\) at each step. \n\!\(\*RowBox[{\"NestWhileList\", \"[\", RowBox[{StyleBox[\"f\", \"TI\"], \",\", StyleBox[\"expr\", \"TI\"], \",\", StyleBox[\"test\", \"TI\"], \",\", StyleBox[\"m\", \"TI\"], \",\", StyleBox[\"max\", \"TI\"]}], \"]\"}]\) applies \!\(\*StyleBox[\"f\", \"TI\"]\) at most \!\(\*StyleBox[\"max\", \"TI\"]\) times. "
NestWhile::usage = "\!\(\*RowBox[{\"NestWhile\", \"[\", RowBox[{StyleBox[\"f\", \"TI\"], \",\", StyleBox[\"expr\", \"TI\"], \",\", StyleBox[\"test\", \"TI\"]}], \"]\"}]\) starts with \!\(\*StyleBox[\"expr\", \"TI\"]\), then repeatedly applies \!\(\*StyleBox[\"f\", \"TI\"]\) until applying \!\(\*StyleBox[\"test\", \"TI\"]\) to the result no longer yields True. \n\!\(\*RowBox[{\"NestWhile\", \"[\", RowBox[{StyleBox[\"f\", \"TI\"], \",\", StyleBox[\"expr\", \"TI\"], \",\", StyleBox[\"test\", \"TI\"], \",\", StyleBox[\"m\", \"TI\"]}], \"]\"}]\) supplies the most recent \!\(\*StyleBox[\"m\", \"TI\"]\) results as arguments for \!\(\*StyleBox[\"test\", \"TI\"]\) at each step. \n\!\(\*RowBox[{\"NestWhile\", \"[\", RowBox[{StyleBox[\"f\", \"TI\"], \",\", StyleBox[\"expr\", \"TI\"], \",\", StyleBox[\"test\", \"TI\"], \",\", \"All\"}], \"]\"}]\) supplies all results so far as arguments for \!\(\*StyleBox[\"test\", \"TI\"]\) at each step. \n\!\(\*RowBox[{\"NestWhile\", \"[\", RowBox[{StyleBox[\"f\", \"TI\"], \",\", StyleBox[\"expr\", \"TI\"], \",\", StyleBox[\"test\", \"TI\"], \",\", StyleBox[\"m\", \"TI\"], \",\", StyleBox[\"max\", \"TI\"]}], \"]\"}]\) applies \!\(\*StyleBox[\"f\", \"TI\"]\) at most \!\(\*StyleBox[\"max\", \"TI\"]\) times. \n\!\(\*RowBox[{\"NestWhile\", \"[\", RowBox[{StyleBox[\"f\", \"TI\"], \",\", StyleBox[\"expr\", \"TI\"], \",\", StyleBox[\"test\", \"TI\"], \",\", StyleBox[\"m\", \"TI\"], \",\", StyleBox[\"max\", \"TI\"], \",\", StyleBox[\"n\", \"TI\"]}], \"]\"}]\) applies \!\(\*StyleBox[\"f\", \"TI\"]\) an extra \!\(\*StyleBox[\"n\", \"TI\"]\) times. \n\!\(\*RowBox[{\"NestWhile\", \"[\", RowBox[{StyleBox[\"f\", \"TI\"], \",\", StyleBox[\"expr\", \"TI\"], \",\", StyleBox[\"test\", \"TI\"], \",\", StyleBox[\"m\", \"TI\"], \",\", StyleBox[\"max\", \"TI\"], \",\", RowBox[{\"-\", StyleBox[\"n\", \"TI\"]}]}], \"]\"}]\) returns the result found when \!\(\*StyleBox[\"f\", \"TI\"]\) had been applied \!\(\*StyleBox[\"n\", \"TI\"]\) fewer times. "
NetAppend::usage = "\!\(\*RowBox[{\"NetAppend\", \"[\", RowBox[{StyleBox[\"chain\", \"TI\"], \",\", StyleBox[\"layer\", \"TI\"]}], \"]\"}]\) appends a layer onto a NetChain.\n\!\(\*RowBox[{\"NetAppend\", \"[\", RowBox[{StyleBox[\"chain\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"layer\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"layer\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}]}], \"]\"}]\) appends several layers to a NetChain."
NetBidirectionalOperator::usage = "\!\(\*RowBox[{\"NetBidirectionalOperator\", \"[\", StyleBox[\"net\", \"TI\"], \"]\"}]\) represents a net that applies \!\(\*StyleBox[\"net\", \"TI\"]\) to a sequence and to its reverse, concatenating both results into one output sequence.\n\!\(\*RowBox[{\"NetBidirectionalOperator\", \"[\", RowBox[{\"{\", RowBox[{StyleBox[\"fnet\", \"TI\"], \",\", StyleBox[\"bnet\", \"TI\"]}], \"}\"}], \"]\"}]\) uses \!\(\*StyleBox[\"fnet\", \"TI\"]\) on the normal input and \!\(\*StyleBox[\"bnet\", \"TI\"]\) on the reversed input.\n\!\(\*RowBox[{\"NetBidirectionalOperator\", \"[\", RowBox[{StyleBox[\"nets\", \"TI\"], \",\", StyleBox[\"agg\", \"TI\"]}], \"]\"}]\) aggregates the two output sequences using the specified aggregation function."
NetChain::usage = "\!\(\*RowBox[{\"NetChain\", \"[\", RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"layer\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"layer\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}], \"]\"}]\) specifies a neural net in which the output of \!\(\*SubscriptBox[StyleBox[\"layer\", \"TI\"], StyleBox[\"i\", \"TI\"]]\) is connected to the input of \!\(\*SubscriptBox[StyleBox[\"layer\", \"TI\"], StyleBox[RowBox[{\"i\", StyleBox[\"+\", FontSlant -> \"Plain\"], StyleBox[\"1\", FontSlant -> \"Plain\"]}], \"TI\"]]\).\n\!\(\*RowBox[{\"NetChain\", \"[\", RowBox[{\"\[LeftAssociation]\", RowBox[{RowBox[{SubscriptBox[StyleBox[\"name\", \"TI\"], StyleBox[\"1\", \"TR\"]], \"\[Rule]\", SubscriptBox[StyleBox[\"layer\", \"TI\"], StyleBox[\"1\", \"TR\"]]}], \",\", RowBox[{SubscriptBox[StyleBox[\"name\", \"TI\"], StyleBox[\"2\", \"TR\"]], \"\[Rule]\", SubscriptBox[StyleBox[\"layer\", \"TI\"], StyleBox[\"2\", \"TR\"]]}], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"\[RightAssociation]\"}], \"]\"}]\) specifies a net consisting of a chain of explicitly named layers. "
NetDecoder::usage = "\!\(\*RowBox[{\"NetDecoder\", \"[\", StyleBox[StyleBox[\"\\\"name\\\"\",ShowStringCharacters->True], \"TI\"], \"]\"}]\) represents a decoder that takes a net representation and decodes it into an expression of a given form.\n\!\(\*RowBox[{\"NetDecoder\", \"[\", RowBox[{\"{\", RowBox[{StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"name\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}], \"]\"}]\) represents a decoder with additional parameters specified."
NetDelete::usage = "\!\(\*RowBox[{\"NetDelete\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", StyleBox[\"n\", \"TI\"]}], \"]\"}]\) deletes the \!\(\*StyleBox[\"n\", \"TI\"]\)\!\(\*RowBox[{SuperscriptBox[\"\[Null]\", \"th\"], \" \", \"layer\"}]\) from a NetChain or NetGraph.\n\!\(\*RowBox[{\"NetDelete\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"name\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True]}], \"]\"}]\) deletes a named layer.\n\!\(\*RowBox[{\"NetDelete\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"spec\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"spec\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}]}], \"]\"}]\) deletes several layers simultaneously."
NetDrop::usage = "\!\(\*RowBox[{\"NetDrop\", \"[\", RowBox[{StyleBox[\"chain\", \"TI\"], \",\", StyleBox[\"n\", \"TI\"]}], \"]\"}]\) removes the first \!\(\*StyleBox[\"n\", \"TI\"]\) layers from a NetChain.\n\!\(\*RowBox[{\"NetDrop\", \"[\", RowBox[{StyleBox[\"chain\", \"TI\"], \",\", RowBox[{\"-\", StyleBox[\"n\", \"TI\"]}]}], \"]\"}]\) removes the last \!\(\*StyleBox[\"n\", \"TI\"]\) layers from a NetChain.\n\!\(\*RowBox[{\"NetDrop\", \"[\", RowBox[{StyleBox[\"chain\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{StyleBox[\"start\", \"TI\"], \",\", StyleBox[\"end\", \"TI\"]}], \"}\"}]}], \"]\"}]\) drops the layers between \!\(\*StyleBox[\"start\", \"TI\"]\) and \!\(\*StyleBox[\"end\", \"TI\"]\) in a NetChain."
NetEncoder::usage = "\!\(\*RowBox[{\"NetEncoder\", \"[\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"name\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \"]\"}]\) represents an encoder that takes a given form of input and encodes it as an array for use in a net.\n\!\(\*RowBox[{\"NetEncoder\", \"[\", RowBox[{\"{\", RowBox[{StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"name\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}], \"]\"}]\) represents an encoder with additional parameters specified."
NetEvaluationMode::usage = "NetEvaluationMode is an option that can be given when applying neural net functions to input data, specifying whether the net should use training-specific behavior."
NetExtract::usage = "\!\(\*RowBox[{\"NetExtract\", \"[\", RowBox[{StyleBox[\"layer\", \"TI\"], \",\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"param\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True]}], \"]\"}]\) extracts the value of a parameter for the specified net layer.\n\!\(\*RowBox[{\"NetExtract\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", StyleBox[\"lspec\", \"TI\"]}], \"]\"}]\) extracts the layer identified by \!\(\*StyleBox[\"lspec\", \"TI\"]\) from within the NetGraph or NetChain object \!\(\*StyleBox[\"net\", \"TI\"]\).\n\!\(\*RowBox[{\"NetExtract\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{StyleBox[\"lspec\", \"TI\"], \",\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"param\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True]}], \"}\"}]}], \"]\"}]\) extracts the value of the parameter \!\(\*StyleBox[\"param\", \"TI\"]\) from the layer identified by \!\(\*StyleBox[\"lspec\", \"TI\"]\) in \!\(\*StyleBox[\"net\", \"TI\"]\). \n\!\(\*RowBox[{\"NetExtract\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", RowBox[{\"NetSharedArray\", \"[\", StyleBox[\"spec\", \"TI\"], \"]\"}]}], \"]\"}]\) extracts the value of a shared array within a network or layer.\n\!\(\*RowBox[{\"NetExtract\", \"[\", RowBox[{StyleBox[\"coder\", \"TI\"], \",\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"param\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True]}], \"]\"}]\) extracts the value of a parameter for the specified NetEncoder or NetDecoder.\n\!\(\*RowBox[{\"NetExtract\", \"[\", RowBox[{StyleBox[\"\[Ellipsis]\", \"TR\"], \",\", RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"spec\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"spec\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}]}], \"]\"}]\) extracts a set of elements, where each \!\(\*SubscriptBox[StyleBox[\"spec\", \"TI\"], StyleBox[\"i\", \"TI\"]]\) is a list."
NetFlatten::usage = "\!\(\*RowBox[{\"NetFlatten\", \"[\", StyleBox[\"net\", \"TI\"], \"]\"}]\) collapses nested NetChain and NetGraph objects within \!\(\*StyleBox[\"net\", \"TI\"]\).\n\!\(\*RowBox[{\"NetFlatten\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", StyleBox[\"n\", \"TI\"]}], \"]\"}]\) collapses up to nesting level \!\(\*StyleBox[\"n\", \"TI\"]\)."
NetFoldOperator::usage = "\!\(\*RowBox[{\"NetFoldOperator\", \"[\", StyleBox[\"net\", \"TI\"], \"]\"}]\) represents a net in which \!\(\*StyleBox[\"net\", \"TI\"]\) is folded over a sequence of inputs, maintaining a recurrent state.\n\!\(\*RowBox[{\"NetFoldOperator\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{RowBox[{SubscriptBox[StyleBox[\"out\", \"TI\"], StyleBox[\"i\", \"TI\"]], \"\[Rule]\", SubscriptBox[StyleBox[\"in\", \"TI\"], StyleBox[\"1\", \"TR\"]]}], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}]}], \"]\"}]\) represents a net in which \!\(\*StyleBox[\"net\", \"TI\"]\) is folded over its inputs, maintaining a recurrent state by feeding the \!\(\*SubscriptBox[StyleBox[\"out\", \"TI\"], StyleBox[\"i\", \"TI\"]]\) of each step back to the \!\(\*SubscriptBox[StyleBox[\"in\", \"TI\"], StyleBox[\"i\", \"TI\"]]\) of the next step.\n\!\(\*RowBox[{\"NetFoldOperator\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", StyleBox[\"feedback\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"const\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"const\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}]}], \"]\"}]\) treats the inputs \!\(\*SubscriptBox[StyleBox[\"const\", \"TI\"], StyleBox[\"i\", \"TI\"]]\) to \!\(\*StyleBox[\"net\", \"TI\"]\) as being constant instead of mapped over.\n\!\(\*RowBox[{\"NetFoldOperator\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", StyleBox[\"feedback\", \"TI\"], \",\", StyleBox[\"constants\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"out\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}]}], \"]\"}]\) returns the sequence of values for the specific outputs \!\(\*SubscriptBox[StyleBox[\"out\", \"TI\"], StyleBox[\"i\", \"TI\"]]\)."
NetGANOperator::usage = "\!\(\*RowBox[{\"NetGANOperator\", \"[\", RowBox[{\"{\", RowBox[{StyleBox[\"generator\", \"TI\"], \",\", StyleBox[\"discriminator\", \"TI\"]}], \"}\"}], \"]\"}]\) represents a network to perform Generative Adversarial Network (GAN) training with a generative net \!\(\*StyleBox[\"generator\", \"TI\"]\) and a classification net \!\(\*StyleBox[\"discriminator\", \"TI\"]\).\n\!\(\*RowBox[{\"NetGANOperator\", \"[\", RowBox[{RowBox[{\"{\", RowBox[{StyleBox[\"generator\", \"TI\"], \",\", StyleBox[\"discriminator\", \"TI\"]}], \"}\"}], \",\", StyleBox[\"loss\", \"TI\"]}], \"]\"}]\) specifies the loss type to be used."
NetGraph::usage = "\!\(\*RowBox[{\"NetGraph\", \"[\", RowBox[{RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"layer\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"layer\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}], \",\", RowBox[{\"{\", RowBox[{RowBox[{SubscriptBox[StyleBox[\"m\", \"TI\"], StyleBox[\"1\", \"TR\"]], \"\[Rule]\", SubscriptBox[StyleBox[\"n\", \"TI\"], StyleBox[\"1\", \"TR\"]]}], \",\", RowBox[{SubscriptBox[StyleBox[\"m\", \"TI\"], \"2\"], \"\[Rule]\", SubscriptBox[StyleBox[\"n\", \"TI\"], StyleBox[\"2\", \"TR\"]]}], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}]}], \"]\"}]\) specifies a neural net defined by a graph in which the output of layer \!\(\*SubscriptBox[StyleBox[\"m\", \"TI\"], StyleBox[\"i\", \"TI\"]]\) is given as input to layer \!\(\*SubscriptBox[StyleBox[\"n\", \"TI\"], StyleBox[\"i\", \"TI\"]]\).\n\!\(\*RowBox[{\"NetGraph\", \"[\", RowBox[{RowBox[{\"\[LeftAssociation]\", RowBox[{RowBox[{SubscriptBox[StyleBox[\"name\", \"TI\"], StyleBox[\"1\", \"TR\"]], \"\[Rule]\", SubscriptBox[StyleBox[\"layer\", \"TI\"], StyleBox[\"1\", \"TR\"]]}], \",\", RowBox[{SubscriptBox[StyleBox[\"name\", \"TI\"], StyleBox[\"2\", \"TR\"]], \"\[Rule]\", SubscriptBox[StyleBox[\"layer\", \"TI\"], StyleBox[\"2\", \"TR\"]]}], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"\[RightAssociation]\"}], \",\", RowBox[{\"{\", RowBox[{RowBox[{SubscriptBox[StyleBox[\"name\", \"TI\"], StyleBox[\"m1\", \"TI\"]], \"\[Rule]\", SubscriptBox[StyleBox[\"name\", \"TI\"], StyleBox[\"n1\", \"TI\"]]}], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}]}], \"]\"}]\) specifies a net with explicitly named layers."
NetInformation::usage = "\!\(\*RowBox[{\"NetInformation\", \"[\", StyleBox[\"net\", \"TI\"], \"]\"}]\) gives a report about the neural network \!\(\*StyleBox[\"net\", \"TI\"]\).\n\!\(\*RowBox[{\"NetInformation\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"prop\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True]}], \"]\"}]\) gives the value of property property \"\!\(\*StyleBox[\"prop\", \"TI\"]\)\" of \!\(\*StyleBox[\"net\", \"TI\"]\).\n\!\(\*RowBox[{\"NetInformation\", \"[\", RowBox[{RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"net\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"net\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}], \",\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"prop\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True]}], \"]\"}]\) gives a list containing the result for each \!\(\*SubscriptBox[StyleBox[\"net\", \"TI\"], StyleBox[\"i\", \"TI\"]]\)."
NetInitialize::usage = "\!\(\*RowBox[{\"NetInitialize\", \"[\", StyleBox[\"net\", \"TI\"], \"]\"}]\) gives a net in which all uninitialized learnable parameters in \!\(\*StyleBox[\"net\", \"TI\"]\) have been given initial values.\n\!\(\*RowBox[{\"NetInitialize\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", \"All\"}], \"]\"}]\) gives a net in which all learnable parameters have been given initial values. "
NetInsertSharedArrays::usage = "\!\(\*RowBox[{\"NetInsertSharedArrays\", \"[\", StyleBox[\"net\", \"TI\"], \"]\"}]\) converts all ordinary arrays in \!\(\*StyleBox[\"net\", \"TI\"]\) into NetSharedArray objects.\n\!\(\*RowBox[{\"NetInsertSharedArrays\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"prefix\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True]}], \"]\"}]\) uses a prefix for the names of all newly shared arrays. "
NetInsert::usage = "\!\(\*RowBox[{\"NetInsert\", \"[\", RowBox[{StyleBox[\"chain\", \"TI\"], \",\", StyleBox[\"layer\", \"TI\"], \",\", StyleBox[\"i\", \"TI\"]}], \"]\"}]\) inserts a layer into a NetChain before the layer at position \!\(\*StyleBox[\"i\", \"TI\"]\).\n\!\(\*RowBox[{\"NetInsert\", \"[\", RowBox[{StyleBox[\"chain\", \"TI\"], \",\", RowBox[{StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"name\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \"->\", StyleBox[\"layer\", \"TI\"]}], \",\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"pos\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True]}], \"]\"}]\) inserts a named layer into a NetChain before the layer at the given position."
NetJoin::usage = "\!\(\*RowBox[{\"NetJoin\", \"[\", RowBox[{SubscriptBox[StyleBox[\"chain\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"chain\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"]\"}]\) connects a series of NetChain objects to form a single NetChain."
NETLink`ActivateWindow::usage = "ActivateWindow is an option to DoNETModeless that specifies whether to make the window visible."
NETLink`AddEventHandler::usage = "\!\(\*RowBox[{\"AddEventHandler\", \"[\", RowBox[{StyleBox[RowBox[{\"obj\", \"@\", \"event\"}], \"TI\"], \",\", StyleBox[\"func\", \"TI\"]}], \"]\"}]\) assigns the specified \!\(\*StyleBox[\"Wolfram Language\", \"RebrandingTerm\", \"ReplacedText\" -> StyleBox[\"Mathematica\", FontSlant -> \"Italic\"]]\) function \!\(\*StyleBox[\"func\", \"TI\"]\) to be called when the given event \!\(\*StyleBox[\"event\", \"TI\"]\) fires."
NETLink`AllowShortContext::usage = "AllowShortContext is an option to LoadJavaClass (in \!\(\*StyleBox[\"J/Link\", FontSlant -> \"Italic\"]\)) and LoadNETType (in \!\(\*StyleBox[\".NET/Link\", FontSlant -> \"Italic\"]\)) that specifies whether the class-specific context in which static method and field definitions are created should be placed on $ContextPath."
NETLink`BeginNETBlock::usage = "\!\(\*RowBox[{\"BeginNETBlock\", \"[\", \"]\"}]\) and \!\(\*RowBox[{\"EndNETBlock\", \"[\", \"]\"}]\) are equivalent to the NETBlock function, except that they work across a larger span than the evaluation of a single expression."
NETLink`CallingConvention::usage = "CallingConvention is an option to DefineDLLFunction that specifies what calling convention the DLL function uses."
NETLink`CastNETObject::usage = "\!\(\*RowBox[{\"CastNETObject\", \"[\", RowBox[{StyleBox[\"obj\", \"TI\"], \",\", StyleBox[\"type\", \"TI\"]}], \"]\"}]\) casts the specified object to a different type."
NETLink`CreateCOMObject::usage = "\!\(\*RowBox[{\"CreateCOMObject\", \"[\", StyleBox[\"str\", \"TI\"], \"]\"}]\) creates a COM object specified by the string \!\(\*StyleBox[\"str\", \"TI\"]\)."
NETLink`DefineDLLFunction::usage = "\!\(\*RowBox[{\"DefineDLLFunction\", \"[\", RowBox[{StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"func\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \",\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"dll\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \",\", StyleBox[\"rtype\", \"TI\"], \",\", StyleBox[\"atypes\", \"TI\"]}], \"]\"}]\) returns a \!\(\*StyleBox[\"Wolfram Language\", \"RebrandingTerm\", \"ReplacedText\" -> StyleBox[\"Mathematica\", FontSlant -> \"Italic\"]]\) function that calls the specified function \!\(\*StyleBox[\"func\", \"TI\"]\) with argument types \!\(\*StyleBox[\"atypes\", \"TI\"]\) and return type \!\(\*StyleBox[\"rtype\", \"TI\"]\) in the specified unmanaged DLL \!\(\*StyleBox[\"dll\", \"TI\"]\).\n\!\(\*RowBox[{\"DefineDLLFunction\", \"[\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"declaration\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \"]\"}]\) lets you write a full C#-syntax \!\(\*StyleBox[\"'extern'\", \"InlineCode\"]\) function declaration. Use this form when you need to write a complex function declaration that requires features not available using options to DefineDLLFunction, such as specific \!\(\*StyleBox[StyleBox[\"\\\"MarshalAs\\\"\",ShowStringCharacters->True], \"InlineCode\"]\) attributes on each of the parameters."
NETLink`DefineNETDelegate::usage = "\!\(\*RowBox[{\"DefineNETDelegate\", \"[\", RowBox[{StyleBox[\"name\", \"TI\"], \",\", StyleBox[\"rtype\", \"TI\"], \",\", StyleBox[\"ptypes\", \"TI\"]}], \"]\"}]\) creates a new .NET delegate type with the given name \!\(\*StyleBox[\"name\", \"TI\"]\), return type \!\(\*StyleBox[\"rtype\", \"TI\"]\), and parameter types \!\(\*StyleBox[\"ptypes\", \"TI\"]\)."
NETLink`DoNETModal::usage = "\!\(\*RowBox[{\"DoNETModal\", \"[\", StyleBox[\"form\", \"TI\"], \"]\"}]\) displays the specified .NET form in the foreground and does not return until the form window is closed.\n\!\(\*RowBox[{\"DoNETModal\", \"[\", RowBox[{StyleBox[\"form\", \"TI\"], \",\", StyleBox[\"expr\", \"TI\"]}], \"]\"}]\) evaluates \!\(\*StyleBox[\"expr\", \"TI\"]\) just before the form is closed and returns the result."
NETLink`DoNETModeless::usage = "\!\(\*RowBox[{\"DoNETModeless\", \"[\", StyleBox[\"form\", \"TI\"], \"]\"}]\) displays the specified .NET form in the foreground and then returns."
NETLink`EndNETBlock::usage = "\!\(\*RowBox[{\"EndNETBlock\", \"[\", \"]\"}]\) and a preceding BeginNETBlock are equivalent to the NETBlock function, except that they work across a larger span than the evaluation of a single expression."
NETLink`FixCRLF::usage = "\!\(\*RowBox[{\"FixCRLF\", \"[\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"str\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \"]\"}]\) changes the linefeeds in the given string to the CR/LF Windows convention."
NETLink`FormStartPosition::usage = "FormStartPosition is an option to DoNETModal, DoNETModeless, ShowNETWindow, and ShowNETConsole that controls the onscreen location of the form when it first appears."
NETLink`GetActiveCOMObject::usage = "\!\(\*RowBox[{\"GetActiveCOMObject\", \"[\", StyleBox[\"string\", \"TI\"], \"]\"}]\) acquires an already-running COM object specified by \!\(\*StyleBox[\"string\", \"TI\"]\), which can be either a ProgID (such as \!\(\*StyleBox[\"\"Excel.Application\"\", \"InlineCode\"]\)) or a CLSID (such as \!\(\*StyleBox[\"\"{8E27C92B-1264-101C-8A2F-040224009C02}\"\", \"InlineCode\"]\))."
NETLink`GetAssemblyObject::usage = "\!\(\*RowBox[{\"GetAssemblyObject\", \"[\", StyleBox[\"asm\", \"TI\"], \"\[InvisibleSpace]\", \"]\"}]\) returns the .NET Assembly object corresponding to the specified NETAssembly expression \!\(\*StyleBox[\"asm\", \"TI\"]\)."
NETLink`GetComplexType::usage = "\!\(\*RowBox[{\"GetComplexType\", \"[\", \"]\"}]\) returns the .NET type that is currently mapped to \!\(\*StyleBox[\"Wolfram Language\", \"RebrandingTerm\", \"ReplacedText\" -> StyleBox[\"Mathematica\", FontSlant -> \"Italic\"]]\) Complex numbers."
NETLink`GetNETException::usage = "\!\(\*RowBox[{\"GetNETException\", \"[\", \"]\"}]\) returns the .NET exception object that was thrown in the most recent call from \!\(\*StyleBox[\"the Wolfram Language\", \"RebrandingTerm\", \"ReplacedText\" -> StyleBox[\"Mathematica\", FontSlant -> \"Italic\"]]\) to .NET."
NETLink`GetTypeObject::usage = "\!\(\*RowBox[{\"GetTypeObject\", \"[\", RowBox[{StyleBox[\"type\", \"TI\"], \"\[InvisibleSpace]\", \"_\", \"NETType\"}], \"]\"}]\) returns the .NET Type object corresponding to the specified NETType expression."
NETLink`InstallNET::usage = "\!\(\*RowBox[{\"InstallNET\", \"[\", \"]\"}]\) launches the .NET runtime and prepares it to be used from \!\(\*StyleBox[\"the Wolfram Language\", \"RebrandingTerm\", \"ReplacedText\" -> StyleBox[\"Mathematica\", FontSlant -> \"Italic\"]]\)."
NETLink`InstanceOf::usage = "\!\(\*RowBox[{\"InstanceOf\", \"[\", RowBox[{StyleBox[\"netobject\", \"TI\"], \",\", StyleBox[\"nettype\", \"TI\"]}], \"]\"}]\) gives True if \!\(\*StyleBox[\"netobject\", \"TI\"]\) is an instance of the type \!\(\*StyleBox[\"nettype\", \"TI\"]\), or a subtype, and False otherwise."
NETLink`KeepNETObject::usage = "\!\(\*RowBox[{\"KeepNETObject\", \"[\", StyleBox[\"object\", \"TI\"], \"]\"}]\) causes the specified object(s) not to be released when the current NETBlock ends. \n\!\(\*RowBox[{\"KeepNETObject\", \"[\", RowBox[{StyleBox[\"object\", \"TI\"], \",\", \"Manual\"}], \"]\"}]\) causes the specified object to escape from all enclosing NETBlock expressions, meaning that the object will only be released if you manually call ReleaseNETObject."
NETLink`LanguageSyntax::usage = "LanguageSyntax is an option to NETTypeInfo that specifies which language syntax will be used to display the type information."
NETLink`LoadCOMTypeLibrary::usage = "\!\(\*RowBox[{\"LoadCOMTypeLibrary\", \"[\", StyleBox[\"library\", \"TI\"], \"]\"}]\) creates a so-called \"interop\" assembly from the named type library and loads that assembly. "
NETLink`LoadedNETAssemblies::usage = "\!\(\*RowBox[{\"LoadedNETAssemblies\", \"[\", \"]\"}]\) returns a list of all the .NET assemblies that have been loaded into the current session."
NETLink`LoadedNETObjects::usage = "\!\(\*RowBox[{\"LoadedNETObjects\", \"[\", \"]\"}]\) returns a list of all the .NET objects that have been loaded into the current session."
NETLink`LoadedNETTypes::usage = "\!\(\*RowBox[{\"LoadedNETTypes\", \"[\", \"]\"}]\) returns a list of all the .NET types that have been loaded into the current session."
NETLink`LoadNETAssembly::usage = "\!\(\*RowBox[{\"LoadNETAssembly\", \"[\", StyleBox[\"assembly\", \"TI\"], \"]\"}]\) loads the specified assembly into the .NET runtime and returns a NETAssembly expression that can be used to identify the assembly. \n\!\(\*RowBox[{\"LoadNETAssembly\", \"[\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"directory\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \"]\"}]\) loads all the assemblies in the given directory and returns a list of NETAssembly expressions.\n\!\(\*RowBox[{\"LoadNETAssembly\", \"[\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"context\\\",\\\"TI\\\"]\\)`\\\"\", ShowStringCharacters->True], \"]\"}]\) loads all the assemblies in the \"assembly\" subdirectory of the main application directory corresponding to the given context.\n\!\(\*RowBox[{\"LoadNETAssembly\", \"[\", RowBox[{StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"name\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \",\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"directory\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True]}], \"]\"}]\) loads the named assembly from the given directory, if possible. \n\!\(\*RowBox[{\"LoadNETAssembly\", \"[\", RowBox[{StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"name\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \",\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"context\\\",\\\"TI\\\"]\\)`\\\"\", ShowStringCharacters->True]}], \"]\"}]\) loads the named assembly from the \"assembly\" subdirectory of the main application directory corresponding to the given context, if possible."
NETLink`LoadNETType::usage = "\!\(\*RowBox[{\"LoadNETType\", \"[\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"type\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \"]\"}]\) loads the specified type into the .NET runtime and returns a NETType expression that can be used to identify the type.\n\!\(\*RowBox[{\"LoadNETType\", \"[\", RowBox[{StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"type\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \",\", StyleBox[\"assembly\", \"TI\"]}], \"]\"}]\) loads the type from the given assembly. "
NETLink`MakeNETObject::usage = "\!\(\*RowBox[{\"MakeNETObject\", \"[\", StyleBox[\"expr\", \"TI\"], \"]\"}]\) constructs a .NET object that represents the given \!\(\*StyleBox[\"Wolfram Language\", \"RebrandingTerm\", \"ReplacedText\" -> StyleBox[\"Mathematica\", FontSlant -> \"Italic\"]]\) expression. \n\!\(\*RowBox[{\"MakeNETObject\", \"[\", RowBox[{StyleBox[\"expr\", \"TI\"], \",\", StyleBox[\"type\", \"TI\"]}], \"]\"}]\) creates an object of the specified type from \!\(\*StyleBox[\"expr\", \"TI\"]\)."
NETLink`MarshalStringsAs::usage = "MarshalStringsAs is an option to DefineDLLFunction that specifies how string arguments should be marshaled into the DLL function. This applies to any arguments that are mapped to the System.String class, which includes types specified in your declaration as \"char*\", \"string\", or \"ByVal As String\"."
NETLink`NETAssembly::usage = "\!\(\*RowBox[{\"NETAssembly\", \"[\", RowBox[{StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"name\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \",\", StyleBox[\"n\", \"TI\"]}], \"]\"}]\) represents a .NET assembly with the specified name."
NETLink`NETBlock::usage = "\!\(\*RowBox[{\"NETBlock\", \"[\", StyleBox[\"expr\", \"TI\"], \"]\"}]\) causes all new .NET objects returned to \!\(\*StyleBox[\"the Wolfram Language\", \"RebrandingTerm\", \"ReplacedText\" -> StyleBox[\"Mathematica\", FontSlant -> \"Italic\"]]\) during the evaluation of \!\(\*StyleBox[\"expr\", \"TI\"]\) to be released when \!\(\*StyleBox[\"expr\", \"TI\"]\) finishes."
NETLink`NETLink::usage = "\!\(\*RowBox[{\"NETLink\", \"[\", \"]\"}]\) returns the \!\(\*StyleBox[\"WSTP\", \"RebrandingTerm\", \"ReplacedText\" -> StyleBox[\"MathLink\", FontSlant -> \"Italic\"]]\) LinkObject that is used to communicate with the \!\(\*StyleBox[\".NET/Link\", FontSlant -> \"Italic\"]\) .NET runtime. "
NETLink`NETNewDelegate::usage = "\!\(\*RowBox[{\"NETNewDelegate\", \"[\", RowBox[{StyleBox[\"type\", \"TI\"], \",\", StyleBox[\"func\", \"TI\"]}], \"]\"}]\) creates a new instance of the specified .NET delegate type whose action is to call the named \!\(\*StyleBox[\"Wolfram Language\", \"RebrandingTerm\", \"ReplacedText\" -> StyleBox[\"Mathematica\", FontSlant -> \"Italic\"]]\) function when triggered."
NETLink`NETNew::usage = "\!\(\*RowBox[{\"NETNew\", \"[\", StyleBox[\"type\", \"TI\"], \"]\"}]\) constructs a new object of the specified .NET type.\n\!\(\*RowBox[{\"NETNew\", \"[\", RowBox[{StyleBox[\"type\", \"TI\"], StyleBox[\",\", \"MR\"], StyleBox[\"args\[Ellipsis]\", \"TI\"]}], \"]\"}]\) constructs a new object of the specified .NET type, passing the supplied argument sequence to the constructor.\n\!\(\*RowBox[{\"NETNew\", \"[\", RowBox[{RowBox[{\"{\", RowBox[{StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"type\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \",\", StyleBox[\"assembly\", \"TI\"]}], \"}\"}], \",\", StyleBox[\"args\[Ellipsis]\", \"TI\"]}], \"]\"}]\) constructs the object from the named type in the specified assembly. \n\!\(\*RowBox[{\"NETNew\", \"[\", RowBox[{RowBox[{\"{\", RowBox[{StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"type\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \",\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"assembly\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \",\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"dir\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True]}], \"}\"}], \",\", StyleBox[\"args\[Ellipsis]\", \"TI\"]}], \"]\"}]\) uses the named assembly from the specified directory, if possible.\n\!\(\*RowBox[{\"NETNew\", \"[\", RowBox[{RowBox[{\"{\", RowBox[{StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"type\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \",\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"assembly\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \",\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"context\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True]}], \"}\"}], \",\", StyleBox[\"args\[Ellipsis]\", \"TI\"]}], \"]\"}]\) uses the named assembly from the \"assembly\" subdirectory of the main application directory corresponding to the given context, if possible."
NETLink`NETObjectQ::usage = "\!\(\*RowBox[{\"NETObjectQ\", \"[\", StyleBox[\"expr\", \"TI\"], \"]\"}]\) gives True if \!\(\*StyleBox[\"expr\", \"TI\"]\) is a valid reference to a .NET object, and False otherwise."
NETLink`NETObjectToExpression::usage = "\!\(\*RowBox[{\"NETObjectToExpression\", \"[\", StyleBox[\"netObject\", \"TI\"], \"]\"}]\) converts the specified .NET object reference into its value as a \"native\" \!\(\*StyleBox[\"Wolfram Language\", \"RebrandingTerm\", \"ReplacedText\" -> StyleBox[\"Mathematica\", FontSlant -> \"Italic\"]]\) expression. "
NETLink`NETTypeInfo::usage = "\!\(\*RowBox[{\"NETTypeInfo\", \"[\", StyleBox[\"type\", \"TI\"], \"]\"}]\) prints information about the specified type, including its inheritance hierarchy, assembly name, and its public members (constructors, methods, properties, and so on). \n\!\(\*RowBox[{\"NETTypeInfo\", \"[\", StyleBox[\"obj\", \"TI\"], StyleBox[\"]\", \"MR\"]}]\) prints information about the object's type.\n\!\(\*RowBox[{\"NETTypeInfo\", \"[\", StyleBox[\"assembly\", \"TI\"], \"]\"}]\) prints information about the types in the assembly specified by the given NETAssembly expression.\n\!\(\*RowBox[{\"NETTypeInfo\", \"[\", RowBox[{StyleBox[\"type\", \"TI\"], \",\", StyleBox[\"members\", \"TI\"]}], \"]\"}]\) prints information about only the specified members, which can be any of the following strings (or a list of them): \"Type\", \"Constructors\", \"Methods\", \"Fields\", \"Properties\", or \"Events\". \n\!\(\*RowBox[{\"NETTypeInfo\", \"[\", RowBox[{StyleBox[\"type\", \"TI\"], \",\", StyleBox[\"members\", \"TI\"], \",\", StyleBox[\"pattern\", \"TI\"]}], \"]\"}]\) prints only the members whose names match the given string pattern."
NETLink`NETType::usage = "\!\(\*RowBox[{\"NETType\", \"[\", RowBox[{StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"name\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \",\", StyleBox[\"n\", \"TI\"]}], \"]\"}]\) represents a .NET type with the specified name."
NETLink`NETUILink::usage = "\!\(\*RowBox[{\"NETUILink\", \"[\", \"]\"}]\) returns the \!\(\*StyleBox[\"WSTP\", \"RebrandingTerm\", \"ReplacedText\" -> StyleBox[\"MathLink\", FontSlant -> \"Italic\"]]\) LinkObject used by calls to \!\(\*StyleBox[\"the Wolfram Language\", \"RebrandingTerm\", \"ReplacedText\" -> StyleBox[\"Mathematica\", FontSlant -> \"Italic\"]]\) that originate from .NET user-interface actions, or Null if no such link is present."
NETLink`ReferencedAssemblies::usage = "ReferencedAssemblies is an option to DefineDLLFunction that specifies assemblies needed to compile your function declaration."
NETLink`ReinstallNET::usage = "\!\(\*RowBox[{\"ReinstallNET\", \"[\", \"]\"}]\) is a convenience function that calls \!\(\*RowBox[{\"UninstallNET\", \"[\", \"]\"}]\) and then \!\(\*RowBox[{\"InstallNET\", \"[\", \"]\"}]\)."
NETLink`ReleaseCOMObject::usage = "\!\(\*RowBox[{\"ReleaseCOMObject\", \"[\", StyleBox[\"obj\", \"TI\"], \"]\"}]\) releases COM resources held by the specified .NET object."
NETLink`ReleaseNETObject::usage = "\!\(\*RowBox[{\"ReleaseNETObject\", \"[\", StyleBox[\"obj\", \"TI\"], \"]\"}]\) tells the .NET memory-management system to forget any references to the specified NETObject that are being maintained solely for the sake of \!\(\*StyleBox[\"the Wolfram Language\", \"RebrandingTerm\", \"ReplacedText\" -> StyleBox[\"Mathematica\", FontSlant -> \"Italic\"]]\)."
NETLink`RemoveEventHandler::usage = "\!\(\*RowBox[{\"RemoveEventHandler\", \"[\", RowBox[{StyleBox[RowBox[{\"obj\", \"@\", \"event\"}], \"TI\"], \",\", StyleBox[\"delegate\", \"TI\"]}], \"]\"}]\) removes the specified delegate from the named event."
NETLink`ReturnAsNETObject::usage = "\!\(\*RowBox[{\"ReturnAsNETObject\", \"[\", StyleBox[\"expr\", \"TI\"], \"]\"}]\) causes a .NET call during the evaluation of \!\(\*StyleBox[\"expr\", \"TI\"]\) to return its result as an object reference (i.e. a NETObject expression), not a value."
NETLink`SafeArrayAsArray::usage = "SafeArrayAsArray is an option to LoadCOMTypeLibrary that specifies whether to import all SAFEARRAYs as System.Array rather than a typed, single-dimensional managed array."
NETLink`SameObjectQ::usage = "\!\(\*RowBox[{\"SameObjectQ\", \"[\", RowBox[{SubscriptBox[StyleBox[\"object\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"object\", \"TI\"], StyleBox[\"2\", \"TR\"]]}], \"]\"}]\) returns True if and only if the NETObject expressions \!\(\*SubscriptBox[StyleBox[\"object\", \"TI\"], StyleBox[\"1\", \"TR\"]]\) and \!\(\*SubscriptBox[StyleBox[\"object\", \"TI\"], StyleBox[\"2\", \"TR\"]]\) refer to the same .NET object."
NETLink`SaveAssemblyAs::usage = "SaveAssemblyAs is an option to LoadCOMTypeLibrary that allows you to specify a file name into which to write the interop assembly that gets generated."
NETLink`SendDelegateArguments::usage = "SendDelegateArguments is an option to AddEventHandler and NETNewDelegate that specifies which of the delegate arguments you want to be passed to your \!\(\*StyleBox[\"Wolfram Language\", \"RebrandingTerm\", \"ReplacedText\" -> StyleBox[\"Mathematica\", FontSlant -> \"Italic\"]]\) callback function."
NETLink`SetComplexType::usage = "\!\(\*RowBox[{\"SetComplexType\", \"[\", StyleBox[\"type\", \"TI\"], \"]\"}]\) tells \!\(\*StyleBox[\".NET/Link\", FontSlant -> \"Italic\"]\) to map the specified type to \!\(\*StyleBox[\"Wolfram Language\", \"RebrandingTerm\", \"ReplacedText\" -> StyleBox[\"Mathematica\", FontSlant -> \"Italic\"]]\) Complex numbers."
NETLink`ShowNETConsole::usage = "\!\(\*RowBox[{\"ShowNETConsole\", \"[\", \"]\"}]\) displays the .NET console window and begins capturing output sent to the \!\(\*StyleBox[\"Console.Out\", \"InlineCode\"]\) and \!\(\*StyleBox[\"Console.Error\", \"InlineCode\"]\) streams.\n\!\(\*RowBox[{\"ShowNETConsole\", \"[\", StyleBox[\"\\\"stdout\\\"\",ShowStringCharacters->True], \"]\"}]\) captures only \!\(\*StyleBox[\"Console.out\", \"InlineCode\"]\).\n\!\(\*RowBox[{\"ShowNETConsole\", \"[\", StyleBox[\"\\\"stderr\\\"\",ShowStringCharacters->True], \"]\"}]\) captures only \!\(\*StyleBox[\"Console.Error\", \"InlineCode\"]\)."
NETLink`ShowNETWindow::usage = "\!\(\*RowBox[{\"ShowNETWindow\", \"[\", StyleBox[\"form\", \"TI\"], \"]\"}]\) displays the specified .NET form in the foreground."
NETLink`StaticsVisible::usage = "StaticsVisible is an option to LoadNETType that specifies whether the class-specific context in which static method and field definitions are created should be placed on $ContextPath."
NETLink`UninstallNET::usage = "\!\(\*RowBox[{\"UninstallNET\", \"[\", \"]\"}]\) shuts down the .NET runtime that was started by InstallNET."
NETLink`WrapInNETBlock::usage = "WrapInNETBlock is an option to AddEventHandler and NETNewDelegate that specifies whether or not the \!\(\*StyleBox[\"Wolfram Language\", \"RebrandingTerm\", \"ReplacedText\" -> StyleBox[\"Mathematica\", FontSlant -> \"Italic\"]]\) callback function assigned to the delegate should be implicitly wrapped in NETBlock."
NETLink`$NETExceptionHandler::usage = "$NETExceptionHandler allows you to control how exceptions thrown in .NET are handled in \!\(\*StyleBox[\"the Wolfram Language\", \"RebrandingTerm\", \"ReplacedText\" -> StyleBox[\"Mathematica\", FontSlant -> \"Italic\"]]\)."
NetMapOperator::usage = "\!\(\*RowBox[{\"NetMapOperator\", \"[\", StyleBox[\"net\", \"TI\"], \"]\"}]\) represents a net in which \!\(\*StyleBox[\"net\", \"TI\"]\) is mapped over a sequence of inputs to give a sequence of outputs."
NetMapThreadOperator::usage = "\!\(\*RowBox[{\"NetMapThreadOperator\", \"[\", StyleBox[\"mapnet\", \"TI\"], \"]\"}]\) represents a net in which \!\(\*StyleBox[\"mapnet\", \"TI\"]\) is mapped over one or more inputs to give one or more outputs.\n\!\(\*RowBox[{\"NetMapThreadOperator\", \"[\", RowBox[{StyleBox[\"mapnet\", \"TI\"], \",\", StyleBox[\"n\", \"TI\"]}], \"]\"}]\) represents a net in which \!\(\*StyleBox[\"mapnet\", \"TI\"]\) is mapped over its inputs at depth \!\(\*StyleBox[\"n\", \"TI\"]\).\n\!\(\*RowBox[{\"NetMapThreadOperator\", \"[\", RowBox[{StyleBox[\"mapnet\", \"TI\"], \",\", RowBox[{\"\[LeftAssociation]\", RowBox[{RowBox[{SubscriptBox[StyleBox[\"input\", \"TI\"], StyleBox[\"1\", \"TR\"]], \"\[Rule]\", SubscriptBox[StyleBox[\"n\", \"TI\"], StyleBox[\"1\", \"TR\"]]}], \",\", RowBox[{SubscriptBox[StyleBox[\"input\", \"TI\"], StyleBox[\"2\", \"TR\"]], \"\[Rule]\", SubscriptBox[StyleBox[\"n\", \"TI\"], StyleBox[\"2\", \"TR\"]]}], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], StyleBox[\"\[RightAssociation]\", \"TR\"]}]}], \"]\"}]\) represents a net in which \!\(\*StyleBox[\"mapnet\", \"TI\"]\) is mapped over the input named \!\(\*SubscriptBox[StyleBox[\"input\", \"TI\"], StyleBox[\"i\", \"TI\"]]\) at depth \!\(\*SubscriptBox[StyleBox[\"n\", \"TI\"], StyleBox[\"i\", \"TI\"]]\), and all other inputs are replicated."
NetMeasurements::usage = "\!\(\*RowBox[{\"NetMeasurements\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", StyleBox[\"data\", \"TI\"], \",\", StyleBox[\"measurement\", \"TI\"]}], \"]\"}]\) computes the requested measurement for the net evaluated on \!\(\*StyleBox[\"data\", \"TI\"]\).\n\!\(\*RowBox[{\"NetMeasurements\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", StyleBox[\"data\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"mspec\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"mspec\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}]}], \"]\"}]\) computes a list of measurements for the net evaluated on \!\(\*StyleBox[\"data\", \"TI\"]\)."
NetModel::usage = "\!\(\*RowBox[{\"NetModel\", \"[\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"name\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \"]\"}]\) obtains a neural net model with the specified name from the Neural Net Repository. \n\!\(\*RowBox[{\"NetModel\", \"[\", RowBox[{\"{\", RowBox[{StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"name\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \",\", RowBox[{SubscriptBox[StyleBox[\"param\", \"TI\"], StyleBox[\"1\", \"TR\"]], \"\[Rule]\", SubscriptBox[StyleBox[\"setting\", \"TI\"], StyleBox[\"1\", \"TR\"]]}], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}], \"]\"}]\) obtains a specified model from a parameterized family of models.\n\!\(\*RowBox[{\"NetModel\", \"[\", RowBox[{StyleBox[\"model\", \"TI\"], \",\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"prop\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True]}], \"]\"}]\) gives property \!\(\*StyleBox[\"prop\", \"TI\"]\) of the model.\n\!\(\*RowBox[{\"NetModel\", \"[\", \"]\"}]\) gives a dataset of available pre-trained neural net models."
NetNestOperator::usage = "\!\(\*RowBox[{\"NetNestOperator\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", StyleBox[\"n\", \"TI\"]}], \"]\"}]\) represents a net in which \!\(\*StyleBox[\"net\", \"TI\"]\) is applied \!\(\*StyleBox[\"n\", \"TI\"]\) times to the input."
NetPairEmbeddingOperator::usage = "\!\(\*RowBox[{\"NetPairEmbeddingOperator\", \"[\", StyleBox[\"net\", \"TI\"], \"]\"}]\) represents a net that takes a pair of arrays, embeds them into a vector space using \!\(\*StyleBox[\"net\", \"TI\"]\), and outputs the distance under the embedding.\n\!\(\*RowBox[{\"NetPairEmbeddingOperator\", \"[\", StyleBox[RowBox[{\"net\", \",\", \"opts\"}], \"TI\"], \"]\"}]\) includes options for distance function to use and other parameters."
NetPortGradient::usage = "\!\(\*RowBox[{\"NetPortGradient\", \"[\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"port\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \"]\"}]\) represents the gradient of the output of a net with respect to the value of the specified input port. \n\!\(\*RowBox[{\"NetPortGradient\", \"[\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"param\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \"]\"}]\) represents the gradient of the output with respect to a learned parameter named \!\(\*StyleBox[\"param\", \"TI\"]\).\n\!\(\*RowBox[{\"NetPortGradient\", \"[\", RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"layer\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"layer\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"], \",\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"param\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True]}], \"}\"}], \"]\"}]\) represents the gradient with respect to a parameter at a specific position in a net."
NetPort::usage = "\!\(\*RowBox[{\"NetPort\", \"[\", RowBox[{\"{\", RowBox[{StyleBox[\"n\", \"TI\"], \",\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"port\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True]}], \"}\"}], \"]\"}]\) represents the specified port for layer number \!\(\*StyleBox[\"n\", \"TI\"]\) in a NetGraph or similar construct.\n\!\(\*RowBox[{\"NetPort\", \"[\", RowBox[{\"{\", RowBox[{StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"name\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \",\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"port\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True]}], \"}\"}], \"]\"}]\) represents the specified port for the layer with the specified name.\n\!\(\*RowBox[{\"NetPort\", \"[\", RowBox[{StyleBox[\"spec\", \"TI\"], \",\", StyleBox[\"port\", \"TI\"]}], \"]\"}]\) is treated as equivalent to \!\(\*RowBox[{\"NetPort\", \"[\", RowBox[{\"{\", RowBox[{StyleBox[\"spec\", \"TI\"], \",\", StyleBox[\"port\", \"TI\"]}], \"}\"}], \"]\"}]\).\n\!\(\*RowBox[{\"NetPort\", \"[\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"port\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \"]\"}]\) represents the specified input or output port for a complete net.\n\!\(\*RowBox[{\"NetPort\", \"[\", RowBox[{\"All\", \",\", StyleBox[\"\\\"States\\\"\",ShowStringCharacters->True]}], \"]\"}]\) represents the set of all states in a net associated with recurrent layers such as LongShortTermMemoryLayer."
NetPrepend::usage = "\!\(\*RowBox[{\"NetPrepend\", \"[\", RowBox[{StyleBox[\"chain\", \"TI\"], \",\", StyleBox[\"layer\", \"TI\"]}], \"]\"}]\) prepends a layer onto a NetChain.\n\!\(\*RowBox[{\"NetPrepend\", \"[\", RowBox[{StyleBox[\"chain\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"layer\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"layer\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}]}], \"]\"}]\) prepends several layers to a NetChain."
NetRename::usage = "\!\(\*RowBox[{\"NetRename\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", RowBox[{StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"old\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \"\[Rule]\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"new\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True]}]}], \"]\"}]\) gives a net in which the name \!\(\*StyleBox[\"old\", \"TI\"]\) for a layer is replaced with \!\(\*StyleBox[\"new\", \"TI\"]\).\n\!\(\*RowBox[{\"NetRename\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"rule\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"rule\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}]}], \"]\"}]\) performs all renamings specified by the \!\(\*SubscriptBox[StyleBox[\"rule\", \"TI\"], StyleBox[\"i\", \"TI\"]]\).\n\!\(\*RowBox[{\"NetRename\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", StyleBox[\"f\", \"TI\"]}], \"]\"}]\) use a function \!\(\*StyleBox[\"f\", \"TI\"]\) to map existing layer names to new names."
NetReplacePart::usage = "\!\(\*RowBox[{\"NetReplacePart\", \"[\", RowBox[{StyleBox[\"layer\", \"TI\"], \",\", RowBox[{StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"array\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \"\[Rule]\", StyleBox[\"value\", \"TI\"]}]}], \"]\"}]\) replaces an array within a layer, returning a new layer.\n\!\(\*RowBox[{\"NetReplacePart\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", RowBox[{StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"port\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \"\[Rule]\", StyleBox[\"type\", \"TI\"]}]}], \"]\"}]\) returns a new layer or network in which an input or output port has the specified type.\n\!\(\*RowBox[{\"NetReplacePart\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", RowBox[{StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"input\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \"\[Rule]\", StyleBox[\"encoder\", \"TI\"]}]}], \"]\"}]\) attaches a \!\(\*RowBox[{\"NetEncoder\", \"[\", StyleBox[\"\[Ellipsis]\", \"TR\"], \"]\"}]\) to a specified input port.\n\!\(\*RowBox[{\"NetReplacePart\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", RowBox[{StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"output\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \"\[Rule]\", StyleBox[\"decoder\", \"TI\"]}]}], \"]\"}]\) attaches a \!\(\*RowBox[{\"NetDecoder\", \"[\", StyleBox[\"\[Ellipsis]\", \"TR\"], \"]\"}]\) to a specified output port.\n\!\(\*RowBox[{\"NetReplacePart\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", RowBox[{StyleBox[\"lspec\", \"TI\"], \"\[Rule]\", StyleBox[\"layer\", \"TI\"]}]}], \"]\"}]\) returns a new NetChain or NetGraph in which the layer identified by \!\(\*StyleBox[\"lspec\", \"TI\"]\) has been replaced.\n\!\(\*RowBox[{\"NetReplacePart\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", RowBox[{RowBox[{\"NetSharedArray\", \"[\", StyleBox[\"name\", \"TI\"], \"]\"}], \"\[Rule]\", StyleBox[\"value\", \"TI\"]}]}], \"]\"}]\) sets a shared array within a network or layer to a specified value.\n\!\(\*RowBox[{\"NetReplacePart\", \"[\", RowBox[{StyleBox[\"coder\", \"TI\"], \",\", RowBox[{StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"param\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \"\[Rule]\", StyleBox[\"value\", \"TI\"]}]}], \"]\"}]\) returns a new \!\(\*RowBox[{\"NetEncoder\", \"[\", StyleBox[\"\[Ellipsis]\", \"TR\"], \"]\"}]\) or \!\(\*RowBox[{\"NetDecoder\", \"[\", StyleBox[\"\[Ellipsis]\", \"TR\"], \"]\"}]\) in which a parameter has been replaced.\n\!\(\*RowBox[{\"NetReplacePart\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", RowBox[{RowBox[{\"{\", RowBox[{StyleBox[\"lspec\", \"TI\"], \",\", StyleBox[\"pspec\", \"TI\"]}], \"}\"}], \"\[Rule]\", StyleBox[\"value\", \"TI\"]}]}], \"]\"}]\) makes a replacement of a part \!\(\*StyleBox[\"pspec\", \"TI\"]\) of a layer or coder \!\(\*StyleBox[\"lspec\", \"TI\"]\) within a NetGraph or NetChain.\n\!\(\*RowBox[{\"NetReplacePart\", \"[\", RowBox[{StyleBox[\"\[Ellipsis]\", \"TR\"], \",\", RowBox[{\"{\", RowBox[{RowBox[{SubscriptBox[StyleBox[\"spec\", \"TI\"], StyleBox[\"1\", \"TR\"]], \"\[Rule]\", SubscriptBox[StyleBox[\"val\", \"TI\"], StyleBox[\"1\", \"TR\"]]}], \",\", RowBox[{SubscriptBox[StyleBox[\"spec\", \"TI\"], StyleBox[\"2\", \"TR\"]], \"\[Rule]\", SubscriptBox[StyleBox[\"val\", \"TI\"], StyleBox[\"2\", \"TR\"]]}], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}]}], \"]\"}]\) makes multiple simultaneous replacements."
NetReplace::usage = "\!\(\*RowBox[{\"NetReplace\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", RowBox[{StyleBox[\"patt\", \"TI\"], \"\[Rule]\", StyleBox[\"layer\", \"TI\"]}]}], \"]\"}]\) gives a net in which all layers matching \!\(\*StyleBox[\"patt\", \"TI\"]\) are replaced with \!\(\*StyleBox[\"layer\", \"TI\"]\).\n\!\(\*RowBox[{\"NetReplace\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"rule\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"rule\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}]}], \"]\"}]\) performs all replacements specified by the \!\(\*SubscriptBox[StyleBox[\"rule\", \"TI\"], StyleBox[\"i\", \"TI\"]]\)."
NetSharedArray::usage = "\!\(\*RowBox[{\"NetSharedArray\", \"[\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"name\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True], \"]\"}]\) represents an array in a net that is shared by more than one layer."
NetStateObject::usage = "\!\(\*RowBox[{\"NetStateObject\", \"[\", StyleBox[\"net\", \"TI\"], \"]\"}]\) creates an object derived from \!\(\*StyleBox[\"net\", \"TI\"]\) that represents a neural net with additional stored state information that is updated when the net is applied to data.\n\!\(\*RowBox[{\"NetStateObject\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", StyleBox[\"seed\", \"TI\"]}], \"]\"}]\) creates an object in which additional stored state information is initialized using \!\(\*StyleBox[\"seed\", \"TI\"]\)."
NetTake::usage = "\!\(\*RowBox[{\"NetTake\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", StyleBox[\"end\", \"TI\"]}], \"]\"}]\) takes only those layers up to \!\(\*StyleBox[\"end\", \"TI\"]\) in a NetChain or NetGraph.\n\!\(\*RowBox[{\"NetTake\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{StyleBox[\"start\", \"TI\"], \",\", StyleBox[\"end\", \"TI\"]}], \"}\"}]}], \"]\"}]\) takes only those layers between \!\(\*StyleBox[\"start\", \"TI\"]\) and \!\(\*StyleBox[\"end\", \"TI\"]\) in a NetChain or NetGraph."
NetTrainResultsObject::usage = "\!\(\*RowBox[{\"NetTrainResultsObject\", \"[\", StyleBox[\"\[Ellipsis]\", \"TR\"], \"]\"}]\) represents an object generated by NetTrain that contains the trained net and other information about the training process."
NetTrain::usage = "\!\(\*RowBox[{\"NetTrain\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{RowBox[{SubscriptBox[StyleBox[\"input\", \"TI\"], StyleBox[\"1\", \"TR\"]], \"\[Rule]\", SubscriptBox[StyleBox[\"output\", \"TI\"], StyleBox[\"1\", \"TR\"]]}], \",\", RowBox[{SubscriptBox[StyleBox[\"input\", \"TI\"], StyleBox[\"2\", \"TR\"]], \"\[Rule]\", SubscriptBox[StyleBox[\"output\", \"TI\"], StyleBox[\"2\", \"TR\"]]}], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}]}], \"]\"}]\) trains the specified neural net by giving the \!\(\*SubscriptBox[StyleBox[\"input\", \"TI\"], StyleBox[\"i\", \"TI\"]]\) as input and minimizing the discrepancy between the \!\(\*SubscriptBox[StyleBox[\"output\", \"TI\"], StyleBox[\"i\", \"TI\"]]\) and the actual output of the net, using an automatically chosen loss function.\n\!\(\*RowBox[{\"NetTrain\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", RowBox[{\"\[LeftAssociation]\", RowBox[{RowBox[{SubscriptBox[StyleBox[\"port\", \"TI\"], StyleBox[\"1\", \"TR\"]], \"\[Rule]\", RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"data\", \"TI\"], StyleBox[\"11\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"data\", \"TI\"], StyleBox[\"12\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}]}], \",\", RowBox[{SubscriptBox[StyleBox[\"port\", \"TI\"], StyleBox[\"2\", \"TR\"]], \"\[Rule]\", RowBox[{\"{\", StyleBox[\"\[Ellipsis]\", \"TR\"], \"}\"}]}], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"\[RightAssociation]\"}]}], \"]\"}]\) trains the specified net by supplying training data at the specified ports.\n\!\(\*RowBox[{\"NetTrain\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"dataset\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True]}], \"]\"}]\) trains on a named dataset from the Wolfram Data Repository.\n\!\(\*RowBox[{\"NetTrain\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", StyleBox[\"f\", \"TI\"]}], \"]\"}]\) calls the function \!\(\*StyleBox[\"f\", \"TI\"]\) during training to produce batches of training data.\n\!\(\*RowBox[{\"NetTrain\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", StyleBox[\"data\", \"TI\"], \",\", StyleBox[\"\\\"\\!\\(\\*StyleBox[\\\"prop\\\",\\\"TI\\\"]\\)\\\"\", ShowStringCharacters->True]}], \"]\"}]\) gives data associated with a specific property \!\(\*StyleBox[\"prop\", \"TI\"]\) of the training session.\n\!\(\*RowBox[{\"NetTrain\", \"[\", RowBox[{StyleBox[\"net\", \"TI\"], \",\", StyleBox[\"data\", \"TI\"], \",\", \"All\"}], \"]\"}]\) gives a \!\(\*RowBox[{\"NetTrainResultsObject\", \"[\", StyleBox[\"\[Ellipsis]\", \"TR\"], \"]\"}]\) that summarizes information about the training session."
NetworkPacketCapture::usage = "\!\(\*RowBox[{\"NetworkPacketCapture\", \"[\", \"]\"}]\) creates a temporary interactive interface for capturing information on network packets transmitted or received through all network interfaces on your computer.\n\!\(\*RowBox[{\"NetworkPacketCapture\", \"[\", StyleBox[\"service\", \"TI\"], \"]\"}]\) captures only packets associated with the specified network service.\n\!\(\*RowBox[{\"NetworkPacketCapture\", \"[\", StyleBox[\"port\", \"TI\"], \"]\"}]\) captures only packets associated with the specified port.\n\!\(\*RowBox[{\"NetworkPacketCapture\", \"[\", StyleBox[\"spec\", \"TI\"], \"]\"}]\) captures only packets matching the specification \!\(\*StyleBox[\"spec\", \"TI\"]\). "
NetworkPacketRecording::usage = "\!\(\*RowBox[{\"NetworkPacketRecording\", \"[\", StyleBox[\"t\", \"TI\"], \"]\"}]\) records information on network packets transmitted or received through all network interfaces on your computer for \!\(\*StyleBox[\"t\", \"TI\"]\) seconds.\n\!\(\*RowBox[{\"NetworkPacketRecording\", \"[\", RowBox[{StyleBox[\"t\", \"TI\"], \",\", StyleBox[\"service\", \"TI\"]}], \"]\"}]\) records only packets associated with the specified network service.\n\!\(\*RowBox[{\"NetworkPacketRecording\", \"[\", RowBox[{StyleBox[\"t\", \"TI\"], \",\", StyleBox[\"port\", \"TI\"]}], \"]\"}]\) records only packets associated with the specified port.\n\!\(\*RowBox[{\"NetworkPacketRecording\", \"[\", RowBox[{StyleBox[\"t\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"port\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"port\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}]}], \"]\"}]\) records only packets associated with any of the ports \!\(\*SubscriptBox[StyleBox[\"port\", \"TI\"], StyleBox[\"i\", \"TI\"]]\).\n\!\(\*RowBox[{\"NetworkPacketRecording\", \"[\", RowBox[{StyleBox[\"t\", \"TI\"], \",\", StyleBox[\"spec\", \"TI\"]}], \"]\"}]\) records only packets matching the specification \!\(\*StyleBox[\"spec\", \"TI\"]\). "
NetworkPacketTrace::usage = "\!\(\*RowBox[{\"NetworkPacketTrace\", \"[\", StyleBox[\"expr\", \"TI\"], \"]\"}]\) evaluates \!\(\*StyleBox[\"expr\", \"TI\"]\) and returns information on network packets transmitted or received through all network interfaces on your computer during the time of the evaluation, together with the result of the evaluation. \n\!\(\*RowBox[{\"NetworkPacketTrace\", \"[\", RowBox[{StyleBox[\"expr\", \"TI\"], \",\", StyleBox[\"service\", \"TI\"]}], \"]\"}]\) records only packets associated with the specified network service.\n\!\(\*RowBox[{\"NetworkPacketTrace\", \"[\", RowBox[{StyleBox[\"expr\", \"TI\"], \",\", StyleBox[\"port\", \"TI\"]}], \"]\"}]\) records only packets associated with the specified port.\n\!\(\*RowBox[{\"NetworkPacketTrace\", \"[\", RowBox[{StyleBox[\"expr\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"port\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"port\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}]}], \"]\"}]\) records only packets associated with any of the ports \!\(\*SubscriptBox[StyleBox[\"port\", \"TI\"], StyleBox[\"i\", \"TI\"]]\).\n\!\(\*RowBox[{\"NetworkPacketTrace\", \"[\", RowBox[{StyleBox[\"expr\", \"TI\"], \",\", StyleBox[\"spec\", \"TI\"]}], \"]\"}]\) records only packets matching the specification \!\(\*StyleBox[\"spec\", \"TI\"]\). "
NeumannValue::usage = "\!\(\*RowBox[{\"NeumannValue\", \"[\", RowBox[{StyleBox[\"val\", \"TI\"], \",\", StyleBox[\"pred\", \"TI\"]}], \"]\"}]\) represents a Neumann boundary value \!\(\*StyleBox[\"val\", \"TI\"]\), specified on the part of the boundary of the region given to NDSolve and related functions where \!\(\*StyleBox[\"pred\", \"TI\"]\) is True."
NevilleThetaC::usage = "\!\(\*RowBox[{\"NevilleThetaC\", \"[\", RowBox[{StyleBox[\"z\", \"TI\"], \",\", StyleBox[\"m\", \"TI\"]}], \"]\"}]\) gives the Neville theta function \!\(\*RowBox[{SubscriptBox[\"\[CurlyTheta]\", \"c\"], \" \", RowBox[{\"(\", RowBox[{\"z\", \"\[VerticalSeparator]\", \"m\"}], \")\"}]}]\). "
NevilleThetaD::usage = "\!\(\*RowBox[{\"NevilleThetaD\", \"[\", RowBox[{StyleBox[\"z\", \"TI\"], \",\", StyleBox[\"m\", \"TI\"]}], \"]\"}]\) gives the Neville theta function \!\(\*RowBox[{SubscriptBox[\"\[CurlyTheta]\", \"d\"], \" \", RowBox[{\"(\", RowBox[{\"z\", \"\[VerticalSeparator]\", \"m\"}], \")\"}]}]\). "
NevilleThetaN::usage = "\!\(\*RowBox[{\"NevilleThetaN\", \"[\", RowBox[{StyleBox[\"z\", \"TI\"], \",\", StyleBox[\"m\", \"TI\"]}], \"]\"}]\) gives the Neville theta function \!\(\*RowBox[{SubscriptBox[\"\[CurlyTheta]\", \"n\"], \" \", RowBox[{\"(\", RowBox[{\"z\", \"\[VerticalSeparator]\", \"m\"}], \")\"}]}]\). "
NevilleThetaS::usage = "\!\(\*RowBox[{\"NevilleThetaS\", \"[\", RowBox[{StyleBox[\"z\", \"TI\"], \",\", StyleBox[\"m\", \"TI\"]}], \"]\"}]\) gives the Neville theta function \!\(\*RowBox[{SubscriptBox[\"\[CurlyTheta]\", \"s\"], \" \", RowBox[{\"(\", RowBox[{\"z\", \"\[VerticalSeparator]\", \"m\"}], \")\"}]}]\). "
NExpectation::usage = "\!\(\*RowBox[{\"NExpectation\", \"[\", RowBox[{StyleBox[\"expr\", \"TI\"], \",\", RowBox[{StyleBox[\"x\", \"TI\"], \"\[Distributed]\", StyleBox[\"dist\", \"TI\"]}]}], \"]\"}]\) gives the numerical expectation of \!\(\*StyleBox[\"expr\", \"TI\"]\) under the assumption that \!\(\*StyleBox[\"x\", \"TI\"]\) follows the probability distribution \!\(\*StyleBox[\"dist\", \"TI\"]\).\n\!\(\*RowBox[{\"NExpectation\", \"[\", RowBox[{StyleBox[\"expr\", \"TI\"], \",\", RowBox[{RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"x\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"x\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}], \"\[Distributed]\", StyleBox[\"dist\", \"TI\"]}]}], \"]\"}]\) gives the numerical expectation of \!\(\*StyleBox[\"expr\", \"TI\"]\) under the assumption that \!\(\*RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"x\", \"TI\"], StyleBox[\"1\", \"TR\"]], \",\", SubscriptBox[StyleBox[\"x\", \"TI\"], StyleBox[\"2\", \"TR\"]], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}]\) follows the multivariate distribution \!\(\*StyleBox[\"dist\", \"TI\"]\). \n\!\(\*RowBox[{\"NExpectation\", \"[\", RowBox[{StyleBox[\"expr\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{RowBox[{SubscriptBox[StyleBox[\"x\", \"TI\"], StyleBox[\"1\", \"TR\"]], \"\[Distributed]\", SubscriptBox[StyleBox[\"dist\", \"TI\"], StyleBox[\"1\", \"TR\"]]}], \",\", RowBox[{SubscriptBox[StyleBox[\"x\", \"TI\"], StyleBox[\"2\", \"TR\"]], \"\[Distributed]\", SubscriptBox[StyleBox[\"dist\", \"TI\"], StyleBox[\"2\", \"TR\"]]}], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], StyleBox[\"}\", \"TR\"]}]}], \"]\"}]\) gives the numerical expectation of \!\(\*StyleBox[\"expr\", \"TI\"]\) under the assumption that \!\(\*SubscriptBox[StyleBox[\"x\", \"TI\"], StyleBox[\"1\", \"TR\"]]\), \!\(\*SubscriptBox[StyleBox[\"x\", \"TI\"], StyleBox[\"2\", \"TR\"]]\), \!\(\*StyleBox[\"\[Ellipsis]\", \"TR\"]\) are independent and follow the distributions \!\(\*SubscriptBox[StyleBox[\"dist\", \"TI\"], StyleBox[\"1\", \"TR\"]]\), \!\(\*SubscriptBox[StyleBox[\"dist\", \"TI\"], StyleBox[\"2\", \"TR\"]]\), \!\(\*StyleBox[\"\[Ellipsis]\", \"TR\"]\). \n\!\(\*RowBox[{\"NExpectation\", \"[\", RowBox[{RowBox[{StyleBox[\"expr\", \"TI\"], \"\[Conditioned]\", StyleBox[\"pred\", \"TI\"]}], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"]\"}]\) gives the numerical conditional expectation of \!\(\*StyleBox[\"expr\", \"TI\"]\) given \!\(\*StyleBox[\"pred\", \"TI\"]\)."
NextCell::usage = "\!\(\*RowBox[{\"NextCell\", \"[\", \"]\"}]\) returns the CellObject corresponding to the cell directly below the currently evaluating cell.\n\!\(\*RowBox[{\"NextCell\", \"[\", StyleBox[\"cellobj\", \"TI\"], \"]\"}]\) starts looking from the given cell.\n\!\(\*RowBox[{\"NextCell\", \"[\", RowBox[{\"NotebookSelection\", \"[\", StyleBox[\"nbobj\", \"TI\"], \"]\"}], \"]\"}]\) starts looking from the bottommost selected item."
NextDate::usage = "\!\(\*RowBox[{\"NextDate\", \"[\", StyleBox[\"gran\", \"TI\"], \"]\"}]\) gives the next occurring date of the specified granularity type \!\(\*StyleBox[\"gran\", \"TI\"]\).\n\!\(\*RowBox[{\"NextDate\", \"[\", StyleBox[\"daytype\", \"TI\"], \"]\"}]\) gives the next day corresponding to the specified \!\(\*StyleBox[\"daytype\", \"TI\"]\).\n\!\(\*RowBox[{\"NextDate\", \"[\", RowBox[{StyleBox[\"date\", \"TI\"], \",\", StyleBox[\"gran\", \"TI\"]}], \"]\"}]\) gives the next date of the given granularity relative to the specified date."
NextPrime::usage = "\!\(\*RowBox[{\"NextPrime\", \"[\", StyleBox[\"x\", \"TI\"], \"]\"}]\) gives the smallest prime above \!\(\*StyleBox[\"x\", \"TI\"]\).\n\!\(\*RowBox[{\"NextPrime\", \"[\", RowBox[{StyleBox[\"x\", \"TI\"], \",\", StyleBox[\"k\", \"TI\"]}], \"]\"}]\) gives the \!\(\*StyleBox[\"k\", \"TI\"]\)\!\(\*SuperscriptBox[\"\[Null]\", \"th\"]\)-next prime above \!\(\*StyleBox[\"x\", \"TI\"]\)."
NextScheduledTaskTime::usage = "\!\(\*RowBox[{\"NextScheduledTaskTime\", \"[\", StyleBox[\"obj\", \"TI\"], \"]\"}]\) gives the next execution time of the scheduled task represented by \!\(\*StyleBox[\"obj\", \"TI\"]\)."
NHoldAll::usage = "NHoldAll is an attribute which specifies that none of the arguments to a function should be affected by N. "
NHoldFirst::usage = "NHoldFirst is an attribute which specifies that the first argument to a function should not be affected by N. "
NHoldRest::usage = "NHoldRest is an attribute which specifies that all but the first argument to a function should not be affected by N. "
NicholsGridLines::usage = "NicholsGridLines is an option to NicholsPlot that specifies contours of constant magnitude and constant phase of the closed-loop system."
NicholsPlot::usage = "\!\(\*RowBox[{\"NicholsPlot\", \"[\", StyleBox[\"lsys\", \"TI\"], \"]\"}]\) generates a Nichols plot of the transfer function for the system \!\(\*StyleBox[\"lsys\", \"TI\"]\).\n\!\(\*RowBox[{\"NicholsPlot\", \"[\", RowBox[{StyleBox[\"lsys\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{SubscriptBox[StyleBox[\"\[Omega]\", \"TR\"], StyleBox[\"min\", \"TI\"]], \",\", SubscriptBox[StyleBox[\"\[Omega]\", \"TR\"], StyleBox[\"max\", \"TI\"]]}], \"}\"}]}], \"]\"}]\) plots for the frequency range \!\(\*SubscriptBox[StyleBox[\"\[Omega]\", \"TR\"], StyleBox[\"min\", \"TI\"]]\) to \!\(\*SubscriptBox[StyleBox[\"\[Omega]\", \"TR\"], StyleBox[\"max\", \"TI\"]]\).\n\!\(\*RowBox[{\"NicholsPlot\", \"[\", RowBox[{StyleBox[\"expr\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{StyleBox[\"\[Omega]\", \"TR\"], \",\", SubscriptBox[StyleBox[\"\[Omega]\", \"TI\"], StyleBox[\"min\", \"TI\"]], \",\", SubscriptBox[StyleBox[\"\[Omega]\", \"TR\"], StyleBox[\"max\", \"TI\"]]}], \"}\"}]}], \"]\"}]\) plots \!\(\*StyleBox[\"expr\", \"TI\"]\) using the variable \!\(\*StyleBox[\"\[Omega]\", \"TR\"]\)."
NightHemisphere::usage = "\!\(\*RowBox[{\"NightHemisphere\", \"[\", \"]\"}]\) is a two-dimensional GeoGraphics primitive that represents the half of the Earth currently in darkness.\n\!\(\*RowBox[{\"NightHemisphere\", \"[\", StyleBox[\"datespec\", \"TI\"], \"]\"}]\) represents the night half of the Earth for the specified date."
NIntegrate::usage = "\!\(\*RowBox[{\"NIntegrate\", \"[\", RowBox[{StyleBox[\"f\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{StyleBox[\"x\", \"TI\"], \",\", SubscriptBox[StyleBox[\"x\", \"TI\"], StyleBox[\"min\", \"TI\"]], \",\", SubscriptBox[StyleBox[\"x\", \"TI\"], StyleBox[\"max\", \"TI\"]]}], \"}\"}]}], \"]\"}]\) gives a numerical approximation to the integral \!\(\*RowBox[{SubsuperscriptBox[\"\[Integral]\", SubscriptBox[\"x\", StyleBox[\"min\", FontSlant -> \"Italic\"]], SubscriptBox[\"x\", StyleBox[\"max\", FontSlant -> \"Italic\"]]], \" \", RowBox[{\"f\", \" \", \"d\", \"\[InvisibleSpace]\", \"x\"}]}]\). \n\!\(\*RowBox[{\"NIntegrate\", \"[\", RowBox[{StyleBox[\"f\", \"TI\"], \",\", RowBox[{\"{\", RowBox[{StyleBox[\"x\", \"TI\"], \",\", SubscriptBox[StyleBox[\"x\", \"TI\"], StyleBox[\"min\", \"TI\"]], \",\", SubscriptBox[StyleBox[\"x\", \"TI\"], StyleBox[\"max\", \"TI\"]]}], \"}\"}], \",\", RowBox[{\"{\", RowBox[{StyleBox[\"y\", \"TI\"], \",\", SubscriptBox[StyleBox[\"y\", \"TI\"], StyleBox[\"min\", \"TI\"]], \",\", SubscriptBox[StyleBox[\"y\", \"TI\"], StyleBox[\"max\", \"TI\"]]}], \"}\"}], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"]\"}]\) gives a numerical approximation to the multiple integral \!\(\*RowBox[{SubsuperscriptBox[\"\[Integral]\", SubscriptBox[\"x\", StyleBox[\"min\", FontSlant -> \"Italic\"]], SubscriptBox[\"x\", StyleBox[\"max\", FontSlant -> \"Italic\"]]], RowBox[{\"d\", \"x\", RowBox[{SubsuperscriptBox[\"\[Integral]\", SubscriptBox[\"y\", StyleBox[\"min\", FontSlant -> \"Italic\"]], SubscriptBox[\"y\", StyleBox[\"max\", FontSlant -> \"Italic\"]]], RowBox[{\"d\", \"\[InvisibleSpace]\", \"y\", \" \", \"\[Ellipsis]\", \" \", \"f\"}]}]}]}]\).\n\!\(\*RowBox[{\"NIntegrate\", \"[\", RowBox[{StyleBox[\"f\", \"TI\"], \",\", RowBox[{RowBox[{\"{\", RowBox[{StyleBox[\"x\", \"TI\"], \",\", StyleBox[\"y\", \"TI\"], \",\", StyleBox[\"\[Ellipsis]\", \"TR\"]}], \"}\"}], \"\[Element]\", StyleBox[\"reg\", \"TI\"]}]}], \"]\"}]\) integrates over the geometric region \!\(\*StyleBox[\"reg\", \"TI\"]\)."
