riptBox[StyleBox[\"x\", \"TI\"], StyleBox[StyleBox[RowBox[{\"i\", StyleBox[\"0\", FontSlant -> \"Plain\"]}]], \"TI\"]]\) and \!\(\*SubscriptBox[StyleBox[\"u\", \"TI\"], StyleBox[StyleBox[RowBox[{\"i\", StyleBox[\"0\", FontSlant -> \"Plain\"]}]], \"TI\"]]\), outputs \!\(\*SubscriptBox[StyleBox[\"g\", \"TI\"], StyleBox[\"i\", \"TI\"]]\), and independent variable \!\(\*StyleBox[\"t\", \"TI\"]\)."
