RiccatiSolve::usage = "\!\(\*RowBox[{\"RiccatiSolve\", \"[\", RowBox[{RowBox[{\"{\", RowBox[{StyleBox[\"a\", \"TI\"], \",\", StyleBox[\"b\", \"TI\"]}], \"}\"}], \",\", RowBox[{\"{\", RowBox[{StyleBox[\"q\", \"TI\"], \",\", StyleBox[\"r\", \"TI\"]}], \"}\"}]}], \"]\"}]\) gives the matrix x that is the stabilizing solution of the continuous algebraic Riccati equation \!\(\*RowBox[{RowBox[{RowBox[{SuperscriptBox[\"a\", StyleBox[\"\[Dagger]\", FontFamily -> \"Helvetica\", SingleLetterItalics -> False], BaseStyle -> {ScriptSizeMultipliers -> {0.6}, ScriptMinSize -> 1}], \".\", \"x\"}], \"+\", RowBox[{\"x\", \".\", \"a\"}], \"-\", RowBox[{\"x\", \".\", \"b\", \".\", SuperscriptBox[\"r\", RowBox[{\"-\", \"1\"}]], \".\", SuperscriptBox[\"b\", StyleBox[\"\[Dagger]\", FontFamily -> \"Helvetica\", SingleLetterItalics -> False], BaseStyle -> {ScriptSizeMultipliers -> {0.6}, ScriptMinSize -> 1}], \".\", \"x\"}], \"+\", \"q\"}], \"\[LongEqual]\", \"0\"}]\).\n\!\(\*RowBox[{\"RiccatiSolve\", \"[\", RowBox[{RowBox[{\"{\", RowBox[{StyleBox[\"a\", \"TI\"], \",\", StyleBox[\"b\", \"TI\"]}], \"}\"}], \",\", RowBox[{\"{\", RowBox[{StyleBox[\"q\", \"TI\"], \",\", StyleBox[\"r\", \"TI\"], \",\", StyleBox[\"p\", \"TI\"]}], \"}\"}]}], \"]\"}]\) solves the equation \!\(\*RowBox[{RowBox[{RowBox[{SuperscriptBox[\"a\", StyleBox[\"\[Dagger]\", FontFamily -> \"Helvetica\", SingleLetterItalics -> False], BaseStyle -> {ScriptSizeMultipliers -> {0.6}, ScriptMinSize -> 1}], \".\", \"x\"}], \"+\", RowBox[{\"x\", \".\", \"a\"}], \"-\", RowBox[{RowBox[{\"(\", RowBox[{RowBox[{\"x\", \".\", \"b\"}], \"+\", \"p\"}], \")\"}], \".\", SuperscriptBox[\"r\", RowBox[{\"-\", \"1\"}]], \".\", RowBox[{\"(\", RowBox[{RowBox[{SuperscriptBox[\"b\", StyleBox[\"\[Dagger]\", FontFamily -> \"Helvetica\", SingleLetterItalics -> False], BaseStyle -> {ScriptSizeMultipliers -> {0.6}, ScriptMinSize -> 1}], \".\", \"x\"}], \"+\", SuperscriptBox[\"p\", StyleBox[\"\[Dagger]\", FontFamily -> \"Helvetica\", SingleLetterItalics -> False], BaseStyle -> {ScriptSizeMultipliers -> {0.6}, ScriptMinSize -> 1}]}], \")\"}]}], \"+\", \"q\"}], \"\[LongEqual]\", \"0\"}]\). "
