\(\*SubscriptBox[StyleBox[\"s\", \"TI\"], StyleBox[\"i\", \"TI\"]]\). \n\!\(\*RowBox[{\"StringPosition\", \"[\", StyleBox[\"patt\", \"TI\"], \"]\"}]\) represents an operator form of StringPosition that can be applied to an expression."
